--
-- Definition of function `smlive`.`BIGTIMEDIFF`
--

DROP FUNCTION IF EXISTS `smlive`.`BIGTIMEDIFF`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`smlive`@`localhost` FUNCTION  `smlive`.`BIGTIMEDIFF`(end_time VARCHAR(64), start_time VARCHAR(64)) RETURNS int(10)
    DETERMINISTIC
BEGIN
DECLARE ret_val INT(10);

SELECT
DATEDIFF(end_time, start_time) * 24
+EXTRACT(HOUR FROM end_time)
- EXTRACT(HOUR FROM start_time)
INTO ret_val
;

RETURN ret_val;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

--
-- Definition of function `smlive`.`CheckAccPeriod`
--

DROP FUNCTION IF EXISTS `smlive`.`CheckAccPeriod`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`smlive`@`localhost` FUNCTION  `smlive`.`CheckAccPeriod`(vpostdate date) RETURNS varchar(50) CHARSET latin1
BEGIN
	declare i integer;
	declare k varchar(50);

  select count(a.accperiodid)
  into i
	from accperiod a
	where month(a.period) = month(vpostdate) and
	year(a.period) = year(vpostdate) and a.recordstatus=1;

  if i>0 then
  	select a.accperiodid
	  into i
	  from accperiod a
	  where month(a.period) = month(vpostdate) and
	  year(a.period) = year(vpostdate) and a.recordstatus=1;
  end if;
	return i;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

