--
-- Definition of function `smlive`.`CheckSaldo`
--

DROP FUNCTION IF EXISTS `smlive`.`CheckSaldo`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`smlive`@`localhost` FUNCTION  `smlive`.`CheckSaldo`(vhpsender varchar(50), vpin integer) RETURNS text CHARSET utf8
BEGIN
	declare agentid integer;
	declare s decimal;
	declare dep decimal;
	declare selisih decimal;
	declare transdate datetime;
	declare msg text;

	select sysdate()
	into transdate
	from dual;

	select ifnull(b.voucheragentid, 0)
	into agentid
	from memberhp a inner join
		voucheragent b on b.voucheragentid = a.voucheragentid
	where a.hpno = vhpsender and b.pin = vpin and a.recordstatus = 1
	limit 1;
	if agentid > 0 then
		set selisih = ifnull(getdeposit(agentid),0) - ifnull(getbea('sal'), 0);
		update voucheragent
		set deposit = selisih
		where voucheragentid = agentid;

		if selisih > 0 then
			values (agentid, transdate, vhpsender, 'check saldo', ifnull(getbea('sal'),0),getdeposit(agentid),1);

			set msg = concat(_utf8 'Saldo ', getdeposit(agentid),' ',getinfo());	
		else
			set msg = getparamvalue('saldotidakcukup');
		end if; 
	else
		set msg = getparamvalue('hppin');
	end if;
	if (msg <> '') then
		values (msg, vhpsender, getphonesid(vhpsender));
	end if;
	return '';
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

