--
-- Definition of function `smlive`.`CheckTrx`
--

DROP FUNCTION IF EXISTS `smlive`.`CheckTrx`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`smlive`@`localhost` FUNCTION  `smlive`.`CheckTrx`(vhpsender varchar(50), 
vpin integer) RETURNS text CHARSET utf8
BEGIN
	declare agentid integer;
	declare done int default 0;
	declare s decimal;
	declare dep decimal;
	declare selisih decimal;
	declare harga text;
	declare vharga text;
	declare transdate datetime;
	declare msg text;
	declare cur1 cursor for
		select concat(trxdate,' ',trxname,' ',vouchername,' bea ',replace(hpdest,'+62','0'),' ',debet)
		from vouchertrx a inner join
		memberhp b on b.voucheragentid = a.voucheragentid inner join
		voucheragent c on c.voucheragentid = b.voucheragentid
		where b.hpno = replace(vhpsender,'+62','0') 
		and a.recordstatus >= 1 limit 3;
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;
	select sysdate()
	into transdate
	from dual;

	select ifnull(b.voucheragentid, 0)
	into agentid
	from memberhp a inner join
		voucheragent b on b.voucheragentid = a.voucheragentid
	where a.hpno = vhpsender and b.pin = vpin and a.recordstatus = 1
	limit 1;
	if agentid > 0 then
		set selisih = ifnull(getdeposit(agentid), 0) - ifnull(getbea('hrg'),0);
		update voucheragent
		set deposit = selisih
		where voucheragentid = agentid;

		if selisih > 0 then
			set vharga = '';
			open cur1;
			repeat
				fetch cur1 into harga;
				if not done then
					set vharga = concat(vharga,'. ',harga);
				end if;
			until done end repeat;
			close cur1;

			values (agentid, transdate, vhpsender, 'check lap',selisih,1);
	
			set msg = vharga;
			if (length(msg) >= 100) then
				set msg = left(msg,100);
			end if;
		else
			set msg = getparamvalue('saldotidakcukup');	
		end if; 
	else
		set msg = getparamvalue('hppin');
	end if;
	if (msg <> '') then
		values (msg, vhpsender, getphonesid(vhpsender));
	end if;
	return '';
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

