--
-- Definition of function `smlive`.`CountSplitStr`
--

DROP FUNCTION IF EXISTS `smlive`.`CountSplitStr`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`smlive`@`localhost` FUNCTION  `smlive`.`CountSplitStr`(x VARCHAR(255),
  delim VARCHAR(12)) RETURNS int(11)
BEGIN
DECLARE count TINYINT(3) UNSIGNED;
DECLARE offset TINYINT(3) UNSIGNED;
DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET x = NULL;

SET count = 0;
SET offset = 1;

REPEAT
IF NOT ISNULL(x) AND offset > 0 THEN
SET offset = LOCATE(delim, x, offset);
IF offset > 0 THEN
SET count = count + 1;
SET offset = offset + 1;
END IF;
END IF;
UNTIL ISNULL(x) OR offset = 0 END REPEAT;

RETURN count;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

