DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`smlive`@`localhost` FUNCTION  `smlive`.`DeleteSub`(vhpsender varchar(50), vhpsub varchar(50), vidsub integer, vpin integer) RETURNS int(11)
BEGIN
	declare agentid integer;
	declare s decimal;
	declare dep decimal;
	declare selisih decimal;
	declare harga text;
	declare j integer;
	declare i integer;
	declare transdate datetime;
	declare pid varchar(50);
	
	select sysdate()
	into transdate
	from dual;

	select ifnull(b.voucheragentid, 0)
	into agentid
	from memberhp a inner join
		voucheragent b on b.voucheragentid = a.voucheragentid
	where a.hpno = vhpsender and b.pin = vpin and recordstatus = 1
	limit 1;
	if agentid > 0 then
		select ifnull(beatrans, 0)
		into s
		from smsformat
		where smsname = 'hapussub';

		select deposit
		into dep
		from voucheragent
		where voucheragentid = agentid;

		set selisih = dep - s;

		if selisih > 0 then
			update voucheragent
			set deposit = selisih
			where voucheragentid = agentid;

			update memberhp
			set recordstatus = 0
			where voucheragentid = vidsub and parentagentid = agentid;

			update voucheragent
			set recordstatus = 0
			where voucheragentid = vidsub and parentagentid = agentid;

			select addressbookid
			into i
			from voucheragentid
			where voucheragentid = vidsub and parentagentid = agentid; 
	
			update addressbook
			set recordstatus = 0
			where addressbookid = i;

			values (agenid, transdate, vhpsender, 'delete sub agent','','',s,0,1);

			values (concat('Sub telah dihapus. Saldo ',selisih), vhpsender, getphonesid(vhpsender));

			return '';	
		else
			return '';
		end if; 
	else
		return '';
	end if;
END $$
