--
-- Definition of function `smlive`.`GetAbsRuleStatusBySchedid`
--

DROP FUNCTION IF EXISTS `smlive`.`GetAbsRuleStatusBySchedid`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`smlive`@`localhost` FUNCTION  `smlive`.`GetAbsRuleStatusBySchedid`(vabsscheduleid int,vdate datetime) RETURNS varchar(5) CHARSET utf8
BEGIN
	declare vReturn,vtimein,vtimeout,vstatus varchar(5);
	declare vjamasal,vitimein,vitimeout int;
	DECLARE done INT DEFAULT 0;
	DECLARE cur1 CURSOR FOR 
		SELECT difftimein,difftimeout,shortstat 
		FROM absrule a inner join absstatus b on b.absstatusid = a.absstatusid 
		where absscheduleid = vabsscheduleid;
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;

	set vjamasal=(hour(vdate)*60) + (minute(vdate));

	OPEN cur1;

	label1:REPEAT
    		FETCH cur1 INTO vtimein,vtimeout,vstatus;
		set vitimein=(left(vtimein,2)*60) + (right(vtimein,2));
		set vitimeout=(left(vtimeout,2)*60) + (right(vtimeout,2));
		if vjamasal >= vitimein and vjamasal <=vitimeout then
			set vreturn=vstatus;
			leave label1;
		end if;
	UNTIL done END REPEAT;
  	CLOSE cur1;
	
	return vReturn;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

--
-- Definition of function `smlive`.`GetAccountValue`
--

DROP FUNCTION IF EXISTS `smlive`.`GetAccountValue`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`smlive`@`localhost` FUNCTION  `smlive`.`GetAccountValue`(vaccountid varchar(100)) RETURNS decimal(25,4)
BEGIN
  declare vvalue decimal(20,4);
  set vvalue = 0;
  select ifnull(sum(ifnull(debit,0) * (select ratevalue from currencyrate cr where cr.currencyid = c.currencyid)) -
  sum(ifnull(credit,0) * (select ratevalue from currencyrate cr where cr.currencyid = c.currencyid)),0)
  into vvalue
  from genledger a
  inner join account b on b.accountid = a.accountid;

  return vvalue;

END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

