CREATE DEFINER=`smlive`@`localhost` FUNCTION  `smlive`.`GetDayWork`(vemployeeid int,vdatefrom date, vdateto date) RETURNS int(11)
BEGIN
	declare tgl,bulan,tahun,vreturn,vid,vfree,vstar,vcount int;
  declare vcurdate date;

  set vcount = 0;
