--
-- Definition of function `smlive`.`GetNewStatusByShortStat`
--

DROP FUNCTION IF EXISTS `smlive`.`GetNewStatusByShortStat`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`smlive`@`localhost` FUNCTION  `smlive`.`GetNewStatusByShortStat`(voldstat varchar(5), vnewstat varchar(5)) RETURNS varchar(5) CHARSET utf8
BEGIN
	declare vreturn varchar(5);
	declare voldid,vnewid int;

	select a.priority
	into voldid
	from absstatus a
	where upper(a.shortstat) = upper(voldstat);
		
	select a.priority
	into vnewid
	from absstatus a
	where upper(a.shortstat) = upper(vnewstat);

	if voldid >= vnewid then
		set vreturn = vnewstat;
	else
	if voldid < vnewid then
		set vreturn = voldstat;
	end if; 
	end if;

	return vreturn;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

