CREATE DEFINER=`smlive`@`localhost` FUNCTION  `smlive`.`GetPhonesID`(destnumber varchar(50)) RETURNS varchar(50) CHARSET utf8
BEGIN
	declare pid varchar(50);
	if (left(destnumber,1) = '+') then
		select phonesid
		into pid
		from phonecenterlist
		where prefixnumber = left(destnumber,6);
	else
	if (left(destnumber,1) = '0') then
		select phonesid
		into pid
		from phonecenterlist
		where prefixnumber = left(destnumber,1);	
	end if;
	end if; 

	select `id`
	into pid
	from phones
	where imei = pid;
	return pid;
END $$
