		select replace(vformatdoc,'MM',vmm) into vformatdoc;
	end if;
	
	if (position('YY' in vrepeatby) > 0) then
		if lyy = 4 then
			select replace(vformatdoc,'YYYY',vyy) into vformatdoc;
