DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`smlive`@`localhost` FUNCTION  `smlive`.`GetSaldoValue`(vRealWord text, vValueSep text, vTheWord text) RETURNS text CHARSET utf8
BEGIN
	declare ret text;
	set ret = split_str(replace(split_str(split_str(right(lower(vRealWord), 
		length(vRealWord)-position(lower(vTheWord) in lower(vRealWord))+1),' ',1),
		vValueSep,2),'.',''),'\n',1);
	return ret;
END $$
