/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`smlive`@`localhost` FUNCTION  `smlive`.`GetScheduleStatusByID`(vabsscheduleid int) RETURNS varchar(3) CHARSET utf8
BEGIN
	declare s varchar(3);
	select ifnull(b.shortstat,'')
	into s
	from absschedule a inner join
  absstatus b on b.absstatusid = a.absstatusid
	where absscheduleid = vabsscheduleid; 
	
	return s;
END $$
