--
-- Definition of function `smlive`.`InsertDeposit`
--

DROP FUNCTION IF EXISTS `smlive`.`InsertDeposit`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`smlive`@`localhost` FUNCTION  `smlive`.`InsertDeposit`(vhpsender varchar(50),vbank varchar(50), 
vnominal decimal, vpin integer) RETURNS varchar(50) CHARSET utf8
BEGIN
	declare agentid integer;
	declare selisih decimal;
	declare msg text;
	declare transdate datetime;

	select sysdate()
	into transdate
	from dual;

	select ifnull(b.voucheragentid, 0)
	into agentid
	from memberhp a inner join
		voucheragent b on b.voucheragentid = a.voucheragentid
	where a.hpno = vhpsender and b.pin = vpin and a.recordstatus = 1
	limit 1;
	if agentid > 0 then
		set selisih = ifnull(getdeposit(agentid),0) - ifnull(getbea('dep'),0);

		update voucheragent
		set deposit = selisih
		where voucheragentid = agentid;
		if selisih >= 0 then
			values (agentid, transdate, vhpsender, concat('deposit bank: ',vbank, ' nominal: ',vnominal), '','',s,0,1);

			values (agentid, vnominal, vbank, 1);
			set msg = concat('Silahkan transfer ke ',getbankyaccount(vbank),' dan konfirmasi ke bagian deposit');	
		end if; 
	else
		set msg = getparamvalue('hppin');
	end if;
	if (msg <> '') then
		values (msg, vhpsender, getphonesid(vhpsender));
	end if;
	return '';
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

