BEGIN
	declare k,l integer;
  declare vrunno varchar(50);
	call insertaddressbook(vemployeename, 0, 1, 0, 0, 0, 0, 0, vcreatedby);
	set k=last_insert_id();

	select snroid
	into l
	from employeetype a
	where a.employeetypeid = vemployeetypeid;

  set vrunno = getrunno(l,now());

		employeetypeid,sexid, bloodtypeid,birthcityid,birthdate,religionid,
