		vmaritalstatusid,vtribeid,vreferenceby,vjoindate,vemployeestatusid,
		vistrial,vbodyheight,vbodyweight,vdresssize,
		vshoesize,vlevelorg);
	set k=last_insert_id();

	update employee
	set barcode=concat('barcode-',k,'.jpg'),
	photo=concat('photo-',k,'.jpg')
	where employeeid = k;
	return k;
END $$
