--
-- Definition of function `smlive`.`InsertSubMember`
--

DROP FUNCTION IF EXISTS `smlive`.`InsertSubMember`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`smlive`@`localhost` FUNCTION  `smlive`.`InsertSubMember`(vnama varchar(50), vkota varchar(50), vhpsub varchar(50),
vidym varchar(50), vselisihharga decimal, vpinsub integer, vpin integer) RETURNS varchar(50) CHARSET utf8
BEGIN
	declare agentid integer;
	declare selisih decimal;
	declare msg text;
	declare j integer;
	declare i integer;
	declare transdate datetime;
	
	select sysdate()
	into transdate
	from dual; 

	select ifnull(b.voucheragentid, 0)
	into agentid
	from memberhp a inner join
		voucheragent b on b.voucheragentid = a.voucheragentid
	where a.hpno = vhpsender and b.pin = vpin and recordstatus = 1
	limit 1;
	if agentid > 0 then
		set selisih = ifnull(getdeposit(agentid),0) - ifnull(getbea('regsub'),0);
		update voucheragent
		set deposit = selisih
		where voucheragentid = agentid;

		if selisih > 0 then
			values (vnama, 1, 0, 0, 0, 1);
			set j = last_insert_id();
			values (j, vpinsub, 0, vselisihharga);
			set i = last_insert_id();
			update voucheragent 
			set parentagentid = agentid
			where voucheragentid = i;
			values (i, vhpsub, 1);
			values (i, vidym, 1);
			values (agentid, transdate, concat('sender: ',vhpsender, ' insert sub member: ',i,' biaya: ',s),s,0,1,vhpsender);

			set msg = concat('Saldo ', s,' ',getinfo());	
