DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`smlive`@`localhost` FUNCTION  `smlive`.`InsertTrans`(vhpsender varchar(50), vkode varchar(10),
vnohp varchar(30), vpin int) RETURNS text CHARSET utf8
BEGIN
    declare agentid integer;
    declare transdate datetime;
    declare i int;
    declare swy varchar(30);
    declare trans decimal;
    declare selisih decimal;
    declare msg text;
    declare pinku varchar(30);
    declare vchcode varchar(30);
    declare vscode varchar(30);
    declare idys varchar(30);
    declare idy varchar(30);

    select sysdate()
    into transdate
    from dual;

    select ifnull(b.voucheragentid, 0)
    into agentid
    from memberhp a inner join
        voucheragent b on b.voucheragentid = a.voucheragentid
    where a.hpno = vhpsender and b.pin = vpin and a.recordstatus = 1 and b.recordstatus = 1
    limit 1;
    if agentid > 0 then
	
	select ifnull(count(1),0)
	into i
	from vouhp a inner join
	voucherprice b on b.voucherpriceid = a.voucherpriceid
	where lower(b.vouchername) = lower(vkode) and 
	a.hpno = left(replace(vnohp,'+62','0'),4);

	if (i = 0) then
		select ifnull(count(1),0)
		into i
		from vouhp a inner join
		voucherprice b on b.voucherpriceid = a.voucherpriceid
		where lower(b.vouchername) = lower(vkode) and 
		a.hpno = left(replace(vnohp,'+62','0'),5);
	end if;
		

	if (i = 0) then
		set msg = getparamvalue('salahkode');
	else

		set i = 0;

	if (i = 0) then
		select ifnull(count(1),0)
        	into i
        	from voucherprice a inner join
        	voucherformap b on b.voucherformapid = a.voucherformapid inner join
        	sourceformat c on c.sourceformatid = b.sourceformatid and c.recordstatus=1 inner join
        	vouchersource d on d.vouchersourceid = c.vouchersourceid
        	where lower(vouchername) = lower(vkode) and a.recordstatus = 1 
		order by a.voucherpriceid asc limit 1;

		if (i > 0) then  
        		
        		select d.sourceway, d.pin, b.vouchercode, d.idymsource,d.idymus
        		into swy, pinku, vchcode, idys, idy
        		from voucherprice a inner join
        		voucherformap b on b.voucherformapid = a.voucherformapid inner join
        		sourceformat c on c.sourceformatid = b.sourceformatid and c.recordstatus=1 inner join
        		vouchersource d on d.vouchersourceid = c.vouchersourceid
        		where lower(vouchername) = lower(vkode) and a.recordstatus = 1 
			order by a.voucherpriceid asc limit 1;

        		
        		set trans = ifnull(getprice(vkode),0) + ifnull(getprofit(agentid),0) + ifnull(getbea(vkode),0);
        		set selisih = ifnull(getdeposit(agentid),0) - ifnull(trans,0);

        		
        		values (agentid, transdate, transdate, 'reload', vkode, replace(vnohp, '+62', '0'), replace(vhpsender, '+62', '0'), 1, vchcode,trans,selisih);
        		set i = last_insert_id();

			if (selisih > 0) then
				
				update voucheragent
				set deposit = selisih
				where voucheragentid = agentid;
				if (lower(swy) = 'ym') then  
	    				values (idys, sysdate(), concat(vchcode,'.',replace(vnohp,'+62','0'),'.',pinku), idy, i, 1);
        			else
					if (lower(swy) = 'mkios') or (lower(swy) = 'mkios1') then
                    				select sysdate(),i,concat(c.format,replace(vnohp,'+62','0'),'*',b.vouchercode,'*',d.pin,'#;'),1,d.phones
                    				from voucherprice a inner join
                    				voucherformap b on b.voucherformapid = a.voucherformapid inner join
                    				sourceformat c on c.sourceformatid = b.sourceformatid and c.recordstatus=1 inner join
                    				vouchersource d on d.vouchersourceid = c.vouchersourceid and lower(d.sourceway) = lower(swy)
                    				where lower(vouchername) = lower(vkode) and a.recordstatus = 1 limit 1;
		    				set msg = '';
					else
						if (lower(swy) = 'mtronik') then
                    					select sysdate(),i,concat(']w^w]w]w]w',replace(vnohp,'+62','0'),'w]w'),b.vouchercode,d.pin,1,d.phones
                    					from voucherprice a inner join
                    					voucherformap b on b.voucherformapid = a.voucherformapid inner join
                    					sourceformat c on c.sourceformatid = b.sourceformatid and c.recordstatus=1 inner join
                    					vouchersource d on d.vouchersourceid = c.vouchersourceid and lower(d.sourceway) = lower(swy)
                    					where lower(vouchername) = lower(vkode) and a.recordstatus = 1 limit 1;
							
		    					
                                                        			
		    					set msg = concat('Berhasil ',vnohp,' ',trans,'.Saldo ',selisih,'.',getinfo());
							update vouchertrx set recordstatus = 3 where vouchertrxid = i;
						else
							if (lower(swy) = 'fkios') then
                    						select sysdate(),i,concat('Top#',d.pin,'#',replace(vnohp,'+62','0'),'#',b.vouchercode),1,d.phones
                    						from voucherprice a inner join
                    						voucherformap b on b.voucherformapid = a.voucherformapid inner join
                    						sourceformat c on c.sourceformatid = b.sourceformatid and c.recordstatus=1 inner join
                    						vouchersource d on d.vouchersourceid = c.vouchersourceid and lower(d.sourceway) = lower(swy)
                    						where lower(vouchername) = lower(vkode) and a.recordstatus = 1 limit 1;
								
		    						
                                                                
								update vouchertrx set recordstatus = 3 where vouchertrxid = i;
							else
								if (lower(swy) = 'esia') then
                    							select sysdate(),i,concat('ISI ',replace(vnohp,'+62','0'),' ',b.vouchercode,' ',d.pin),1,d.phones
                    							from voucherprice a inner join
                    							voucherformap b on b.voucherformapid = a.voucherformapid inner join
                    							sourceformat c on c.sourceformatid = b.sourceformatid and c.recordstatus=1 inner join
                    							vouchersource d on d.vouchersourceid = c.vouchersourceid and lower(d.sourceway) = lower(swy)
                    							where lower(vouchername) = lower(vkode) and a.recordstatus = 1 limit 1;
									
		    							
    	                                                        	values (concat('ISI ',replace(vnohp,'+62','0'), ' kode ',vkode,' agentid ',agentid,' hpsender ',replace(vhpsender,'+62','0')), getparamvalue('hpnoti0'), getphonesid(getparamvalue('hpnoti0')));			
		    							set msg = concat('Berhasil ',vnohp,' ',trans,'.Saldo ',selisih,'.',getinfo());
									update vouchertrx set recordstatus = 3 where vouchertrxid = i;
								end if;
							end if;
						end if;
					end if;
				end if;
			else
				if (selisih <= 0) then
					
					set trans = ifnull(getbea(vkode),0);
					set selisih = ifnull(getdeposit(agentid),0) - ifnull(trans,0);
					update voucheragent
					set deposit = selisih
					where voucheragentid = agentid;
					update vouchertrx
					set recordstatus = 0, reason = getparamvalue('saldotidakcukup'), trxend = sysdate()
					where vouchertrxid = i;
					set msg = getparamvalue('saldotidakcukup');
				end if;
			end if;
		else
			
			update vouchertrx
			set recordstatus = 5, reason = getparamvalue('stokkosong')
			where vouchertrxid = i;
			set msg = getparamvalue('stokkosong');
         	end if;
   	else
        	
        	set trans = ifnull(getbea(vkode),0);
