		update voucheragent
		set deposit = selisih
		where voucheragentid = agentid;
		update vouchertrx
		set recordstatus = 4, debet = trans, saldo = selisih, reason = getparamvalue('stokkosong')
		where vouchertrxid = i;
		set msg = getparamvalue('orderganda');
    	end if;
	end if;
    else
	set msg = getparamvalue('hppin');
    end if;
    if (msg <> '') then 
    	values (msg, vhpsender, getphonesid(vhpsender));
    end if;
    return '';
END $$
