--
-- Definition of procedure `smlive`.`ApplicantGraduation`
--

DROP PROCEDURE IF EXISTS `smlive`.`ApplicantGraduation`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`smlive`@`localhost` PROCEDURE  `smlive`.`ApplicantGraduation`(vemployeeid integer, vlastupdateby varchar(50))
BEGIN
	declare vid,vsnroid,vabid,vrecstat,vnextstat integer;

	select a.employeetypeid,a.addressbookid,b.snroid,c.isemployee
	into vid,vabid,vsnroid,vrecstat
	from employee a
	inner join employeetype b on b.employeetypeid = a.employeetypeid
	inner join addressbook c on c.addressbookid = a.addressbookid
	where employeeid = vemployeeid;

	if vid > 0 then
		if getwfbefstatbycreated('applicantgrad',vrecstat,vlastupdateby) > 0 then
	 		select getwfrecstatbycreated
			into vnextstat;
			update addressbook
			set isemployee=vnextstat
			where addressbookid = vabid;
			
			if getwfcomparemax('applicantgrad',vnextstat,vlastupdateby) > 0 then
				update employee
				set newnik = getrunno(vsnroid,now())
				where employeeid = vemployeeid;
			end if;
		end if;
	end if;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

