              into vcount
              from employeewage
              where employeeid = vid and month(wageperiod)=month(vovertimedate) and year(wageperiod)=year(vovertimedate);
              if vcount = 0 then
                values (vid,vovertimedate,1);
	              set k=last_insert_id();
              else
                select employeewageid
                into k
                from employeewage
                where employeeid = vid  and month(wageperiod)=month(vovertimedate) and year(wageperiod)=year(vovertimedate);
              end if;

                            select getempschedbyempdate(vid,vovertimedate)
              into vsched;

              if (vsched = vfreeschedule) then
                values (k,vovertimedate,vovertimedate,vamount,vcurrencyid,vtransport,'transport');
              end if;
            end if;
          end if;



      UNTIL done END REPEAT;
  CLOSE cur1;
END $$
