CREATE DEFINER=`smlive`@`localhost` PROCEDURE  `smlive`.`ApproveDeposit`(vmemberdepid integer, vlastupdateby integer)
BEGIN
	declare i,vrecstat integer;
	declare dep decimal;
	declare deb decimal;

	select voucheragentid, depositvalue, recordstatus
	into i, dep, vrecstat
	from memberdep
	where memberdepid = vmemberdepid;

	update memberdep
	set recordstatus = getwfrecstatbycreated('appdep',vlastupdateby)
	where memberdepid = vmemberdepid;

	call inserttranslog(concat('approve memberdep ',
			' memberdepid=',vmemberdepid,
			' recordstatus=',vrecstat,'>',getwfrecstatbycreated('appdep',vlastupdateby),
			' by=',vlastupdateby,' date=',sysdate()));

	if getwfcomparemax('appdep',vlastupdateby) > 0 then
		set deb = dep + ifnull(getdeposit(i),0);

		update voucheragent
		set deposit = deb
		where voucheragentid = i; 
	end if;
END $$
