--
-- Definition of procedure `smlive`.`ApproveEmployeeOvertime`
--

DROP PROCEDURE IF EXISTS `smlive`.`ApproveEmployeeOvertime`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`smlive`@`localhost` PROCEDURE  `smlive`.`ApproveEmployeeOvertime`(vid integer, vlastupdateby varchar(50))
BEGIN
	declare vsnroid,vrecstat,vnextstat,vtypeid,vovertimeid,vhour,vovertimedate,
    vcurrencyid,vcount,k,j,vfreeschedule,vsched,vselabsen,vwagetypeid integer;
  declare vtime_in,vtime_out,vsched_out time;
  declare vamount,vovervalue,vtotalamount decimal(20,4);
	declare vpostdate,vpodate,vdate_in,vdate_out date;
  DECLARE done INT DEFAULT 0;
  DECLARE cur1 CURSOR FOR
    SELECT b.overtimedate,hour(timediff(a.overtimeend,a.overtime)),a.employeeid
    FROM employeeoverdet a
      inner join employeeover b on b.employeeoverid
      where a.employeeoverid = vid;
  DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET done=1;


	select c.overtimedate,c.recordstatus
	into vpostdate,vrecstat
	from employeeover c
	where c.employeeoverid = vid;


	select getwfrecstatbycreated('appempover',vrecstat,vlastupdateby)
	into vnextstat;


  select snroid
  into vsnroid
  from snro
  where upper(description) = upper('Employee Overtime');

  select paramvalue
  into vovertimeid
  from parameter
  where upper(paramname) = upper('wageovertime');

  select paramvalue
  into vfreeschedule
  from parameter
  where upper(paramname) = upper('freeschedule');

select paramvalue
  into vwagetypeid
  from parameter
  where upper(paramname) = upper('wagegapok');


	if checkaccperiod(vpostdate) > 0 then
		if GetWfBefStatByCreated('appempover',vrecstat,vlastupdateby) > 0 then
	   		update employeeover
	   		set overtimeno = ifnull(overtimeno,getrunno(vsnroid,vpostdate)),
				recordstatus=vnextstat
	   		where employeeoverid = vid;
        if getwfcomparemax('appempover',vnextstat,vlastupdateby) = 1 then

          OPEN cur1;
          read_loop: LOOP
            FETCH cur1 INTO vovertimedate,vhour,vid;
             IF done THEN
                LEAVE read_loop;
             END IF;

                        select ifnull(a.amount,0), b.currencyid
            into vamount, vcurrencyid
            from employeebenefitdetail a
            inner join employeebenefit b on b.employeebenefitid = a.employeebenefitid
            where b.employeeid = vid and a.wagetypeid = vovertimeid;


            if vamount > 0 then
              select ifnull(count(1),0)
              into vcount
              from employeewage
              where employeeid = vid and month(wageperiod) = month(vovertimedate) and year(wageperiod) = year(vovertimedate);
              if vcount > 0 then
                values (vid,vovertimedate,vamount,1);
	              set k=last_insert_id();
              else
                select employeewageid
                into k
                from employeewage
                where employeeid = vid and month(wageperiod) = month(vovertimedate) and year(wageperiod) = year(vovertimedate);
              end if;

select ifnull(count(1),0)
              into vcount
              from employeetax
              where employeeid = vid and month(wageperiod) = month(vovertimedate) and year(taxperiod) = year(vovertimedate);
              if vcount > 0 then
                values (vid,vovertimedate,vamount,1);
	              set j=last_insert_id();
              else
                select employeetaxid
                into j
                from employeetax
                where employeeid = vid and month(taxperiod) = month(vovertimedate) and year(taxperiod) = year(vovertimedate);
              end if;

                            select getempschedbyempdate(vid,vovertimedate)
              into vsched;

              select absout
              into vsched_out
              from absschedule
              where absscheduleid = vsched;

                            select date_in,date_out,time_in,time_out
              into vdate_in,vdate_out,vtime_in,vtime_out
              from abstrans
              where employeeid = vid and date(date_in) = date(vovertimedate);

              select overvalue
              into vovervalue
              from employeetype a
              inner join employee b on b.employeetypeid = a.employeetype
              where b.employeeid = vid;

              set vselabsen =hour(timediff(vtime_out,vsched_out));
              set vtotalamount = 0;


                            if (vselabsen >= 1) then
                                if (vhour <= vselabsen) then
                  set vselabsen = vhour;
                end if;

                                if (vsched like concat('%',vfreeschedule,'%')) then
                  if (vselabsen >= 8) then
                    set vselabsen = 8;
                  end if;

                  if (vselabsen >= 7) then
                    set vtotalamount = vovervalue * vwagetypeid * 1.5;
                  end if;

                  if (vselabsen >= 8) then
                    set vtotalamount = (vselabsen - 7) * vovervalue * vwagetypeid * 3;
                  end if;

                else
                                                      if (vselabsen >= 3) then
                    set vselabsen = 3;
                  end if;


                  if (vselabsen >= 1) then
                    set vtotalamount = vovervalue * vwagetypeid;
                  end if;

                  if (vselabsen >= 2) then
                    set vtotalamount = (vselabsen - 1) * vovervalue * vwagetypeid;
                  end if;


                end if;
                values (k,vovertimedate,vovertimedate,vtotalamount,vcurrencyid,vovertimeid,'overtime');
                values (j,vovertimedate,vovertimedate,vtotalamount,vcurrencyid,vovertimeid,'overtime');
              end if;

            end if;
          END LOOP;
          CLOSE cur1;

        end if;
    else
      CALL pRaiseError('<flowapppr>');
    end if;
  else
    CALL pRaiseError('<periodover>');
  end if;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

--
-- Definition of procedure `smlive`.`ApproveEmployeeSchedule`
--

DROP PROCEDURE IF EXISTS `smlive`.`ApproveEmployeeSchedule`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`smlive`@`localhost` PROCEDURE  `smlive`.`ApproveEmployeeSchedule`(vEmployeeScheduleid integer, vLastUpdateby varchar(50))
BEGIN
	declare lastd,vd1,vd2,vd3,vd4,vd5,vd6,vd7,vd8,vd9,vd10,vd11,vd12,vd13,vd14,vd15,vd16,
