--
-- Definition of procedure `smlive`.`ApproveGI`
--

DROP PROCEDURE IF EXISTS `smlive`.`ApproveGI`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='' */ $$
CREATE DEFINER=`smlive`@`localhost` PROCEDURE  `smlive`.`ApproveGI`(vid integer, vlastupdateby varchar(50))
BEGIN
  DECLARE done INT DEFAULT 0;
	declare vsnroid,vrecstat,vnextstat,vslocid,vtypeid,vuomid,vuomgudangid,vproductdetailid,visd, vpoid,
    vpodetailid, vdadetailid,vdaid,k,vproductid integer;
	declare vpostdate,vdate date;
  declare vconv,vcurrstock,vqty,vqtyres decimal(10,4);
	declare vgrno,vserialno,vlocation varchar(50);
  DECLARE cur1 CURSOR FOR
    SELECT productdetailid,qty,unitofmeasureid,slocid,deliveryadvicedetailid,
      serialno
    FROM gidetail
    where giheaderid = vid;
  DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET done=1;

  update giheader
  set postdate = gidate
  where giheaderid = vid;

	select a.postdate, a.gidate, a.recordstatus, c.deliveryadviceid,a.location
	into vpostdate, vdate, vrecstat, vdaid,vlocation
	from giheader a
  left join deliveryadvice c on c.deliveryadviceid = a.deliveryadviceid
	where a.giheaderid = vid;

	select ifnull(a.snroid,0), a.prodtranstypeid
	into vsnroid,vtypeid
	from prodtranstype a
	where upper(a.prodtranscode) = upper('GI');

	select getwfrecstatbycreated('appgi',vrecstat,vlastupdateby)
	into vnextstat;

select ifnull(count(1),0)
into k
from gidetail
where giheaderid = vid;

if k > 0 then

	if checkaccperiod(vpostdate) > 0 then
		if GetWfBefStatByCreated('appgi',vrecstat,vlastupdateby) > 0 then
update giheader
	   		set gino = ifnull(gino,getrunno(vsnroid,vdate)),
				recordstatus=vnextstat
	   		where giheaderid = vid;
			if getwfcomparemax('appgi',vnextstat,vlastupdateby) = 1 then


OPEN cur1;
read_loop: LOOP
      
      FETCH cur1 INTO vproductdetailid,vqty,vuomid,vslocid,vdadetailid,
        vserialno;
      IF done THEN
        LEAVE read_loop;
      END IF;
      

      select productid
      into vproductid
      from productdetail
      where productdetailid = vproductdetailid;

      select deliveryadvicedetailid
      into vdadetailid
      from deliveryadvicedetail
      where deliveryadviceid =vdaid
      limit 1;

select gino
into vgrno
from giheader
where giheaderid = vid;

select qty - ifnull(giqty,0)
      into vqtyres
      from deliveryadvicedetail
      where deliveryadvicedetailid = vdadetailid;

      if vqtyres >= vqty then

        update deliveryadvicedetail
        set giqty = vqty*-1
        where deliveryadvicedetailid = vdadetailid;

        update productdetail
        set location = vlocation, locationdate = vdate, referenceno = vgrno, slocid=null
        where productdetailid = vproductdetailid;

          buydate,buyprice,currencyid,picproduct,productid,recordstatus,location,
          locationdate,materialcode,materialstatusid,ownershipid,grheaderid,grdetailid,
          referenceno,productdetailid,productname)
        select slocid,expiredate,serialno,vqty*-1,unitofmeasureid,
          buydate,buyprice,currencyid,picproduct,productid,recordstatus,location,
          locationdate,materialcode,materialstatusid,ownershipid,grheaderid,grdetailid,
          vgrno,productdetailid,productname
        from productdetail a
        where productdetailid = vproductdetailid;

        update productstock
        set qty = qty-vqty
        where productid = vproductid and slocid = vslocid;

          prodtranstypeid,referenceno,productstockid)
        values (vproductid,vqty*-1,vuomid,vslocid,vid,vtypeid,vgrno,
          (select productstockid from productstock
          where productid=vproductid and slocid = vslocid limit 1));


      else
        set done=2;
        CALL pRaiseError('<igiover>');
        LEAVE read_loop;
      end if;

   
END LOOP;
CLOSE cur1;

end if;
end if;
end if;

else
  CALL pRaiseError('<detailempty>');
end if;

END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

