-- Definition of procedure `smlive`.`ApproveGR`
--

DROP PROCEDURE IF EXISTS `smlive`.`ApproveGR`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='' */ $$
CREATE DEFINER=`smlive`@`localhost` PROCEDURE  `smlive`.`ApproveGR`(vid integer, vlastupdateby varchar(50))
BEGIN
DECLARE done,loopa INT DEFAULT 0;
	declare vsnroid,vrecstat,vnextstat,vslocid,vtypeid,vuomid,vuomgudangid,vproductid,visd, vpoid, vpodetailid,
    vsid,visasset,vgrid,vcurrencyid,k,x,vmatcode integer;
	declare vpostdate,vdate,vbuydate date;
declare vconv,vcurrstock,vqty,vqtyres,vbuyprice,vratevalue decimal(30,4);
	declare vgrno,vmaterialcode varchar(50);
DECLARE cur1 CURSOR FOR SELECT a.productid,qty,unitofmeasureid,slocid,podetailid,grdetailid
FROM grdetail a inner join product b on b.productid = a.productid
where grheaderid = vid and b.isstock=1;
DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET done=1;

	   		update grheader
	   		set postdate=grdate
	   		where grheaderid = vid;

	select a.grdate, a.grdate, a.recordstatus, b.poheaderid
	into vpostdate, vdate, vrecstat, vpoid
	from grheader a inner join poheader b on b.poheaderid = a.poheaderid
	where a.grheaderid = vid;

  select snroid
  into vsnroid
  from snro
  where upper(description) = ('Goods Receipt');

	select getwfrecstatbycreated('appgr',vrecstat,vlastupdateby)
	into vnextstat;

select ifnull(count(1),0)
into k
from grdetail
where grheaderid = vid;

if k > 0 then

	if checkaccperiod(vpostdate) > 0 then

		if GetWfBefStatByCreated('appgr',vrecstat,vlastupdateby) > 0 then
update grheader
	   		set grno = ifnull(grno,getrunno(vsnroid,vdate)),
				recordstatus=vnextstat
	   		where grheaderid = vid;

	select a.grno
	into vgrno
	from grheader a
	where a.grheaderid = vid;

		if getwfcomparemax('appgr',vnextstat,vlastupdateby) = 1 then


OPEN cur1;
read_loop: LOOP
      
      FETCH cur1 INTO vproductid,vqty,vuomid,vslocid,vpodetailid,vgrid;
      IF done THEN
        LEAVE read_loop;
      END IF;
      

	select a.snroid
	into vmatcode
	from productplant a
	where a.productid = vproductid;


      select ifnull(poqty,0) - ifnull(qtyres,0)
      into vqtyres
      from podetail
      where poheaderid = vpoid and podetailid = vpodetailid and productid = vproductid;

      if vqtyres >= vqty then

        select ifnull(count(1),0)
        into visd
        from productstock
        where productid = vproductid and slocid = vslocid and unitofmeasureid = vuomid;

        if (visd>0) then
          select qty
          into vcurrstock
          from productstock
          where productid = vproductid and slocid = vslocid and unitofmeasureid = vuomid;

          update productstock
          set qty = vcurrstock + vqty
          where productid = vproductid and slocid = vslocid and unitofmeasureid = vuomid;

        else

          values (vproductid,vslocid,vqty,vuomid);
        end if;

        update podetail
        set qtyres = qtyres + vqty
        where poheaderid = vpoid and productid = vproductid and podetailid = vpodetailid;

select a.grno
	into vgrno
	from grheader a
	where a.grheaderid = vid;

select productstockid
        into visd
        from productstock
        where productid = vproductid and slocid = vslocid and unitofmeasureid = vuomid;

        values(vslocid,vqty,vuomid,vproductid,vgrno,visd);

select ifnull(isautolot,0)
        into visasset
        from productplant
        where productid = vproductid
        limit 1;

select a.grdate
        into vbuydate
        from grheader a
        where a.grheaderid = vid;

        select a.netprice,a.currencyid
        into vbuyprice,vcurrencyid
        from podetail a
        where a.podetailid = vpodetailid;

if (visasset = 1) then
          SET x = 0;
          REPEAT
            SET x = x + 1;
              currencyid,productid,recordstatus,location,locationdate,grheaderid,grdetailid,expiredate,
              referenceno,materialcode)
            values (vslocid,1,vuomid,vbuydate,vbuyprice,
              vcurrencyid,vproductid,1,(select description from sloc where slocid = vslocid),
              vdate,vid,vgrid,vbuydate,vgrno,ifnull(materialcode,getrunno(vmatcode,vdate)));

            set k=last_insert_id();

select materialcode
into vmaterialcode
from productdetail
where productdetailid = k;

              currencyid,productid,recordstatus,location,locationdate,grheaderid,grdetailid,
              referenceno,productdetailid,expiredate,materialcode)
            values (vslocid,1,vuomid,vbuydate,vbuyprice,
              vcurrencyid,vproductid,1,(select description from sloc where slocid = vslocid),
              vdate,vid,vgrid,vgrno,k,vbuydate,vmaterialcode);
          UNTIL x = vqty END REPEAT;
        end if;

if (visasset = 0) then
              currencyid,productid,recordstatus,location,locationdate,grheaderid,grdetailid,expiredate,
              referenceno,materialcode)
            values (vslocid,vqty,vuomid,vbuydate,vbuyprice,
              vcurrencyid,vproductid,1,(select description from sloc where slocid = vslocid),
              vdate,vid,vgrid,vbuydate,vgrno,ifnull(materialcode,getrunno(vmatcode,vdate)));

            set k=last_insert_id();

select materialcode
into vmaterialcode
from productdetail
where productdetailid = k;

              currencyid,productid,recordstatus,location,locationdate,grheaderid,grdetailid,
              referenceno,productdetailid,materialcode)
            values (vslocid,vqty,vuomid,vbuydate,vbuyprice,
              vcurrencyid,vproductid,1,(select description from sloc where slocid = vslocid),
              vdate,vid,vgrid,vgrno,k,vmaterialcode);
        end if;

      else
        set done=2;
        CALL pRaiseError('<igrover>');
        LEAVE read_loop;
      end if;

   
END LOOP;
CLOSE cur1;


update podetail
set qtyres = poqty
where poheaderid = vpoid and productid in (select t.productid from product t where isstock = 0);

end if;
end if;
end if;

else
  CALL pRaiseError('<detailempty>');
end if;

END $$
