CREATE DEFINER=`smlive`@`localhost` PROCEDURE  `smlive`.`ApproveJournal`(vid integer, vlastupdateby varchar(50))
    MODIFIES SQL DATA
    DETERMINISTIC
BEGIN
	declare vrecstat,vnextstat,vsnroid integer;
	declare vpostdate date;
	declare vdebit,vcredit double;

	select a.postdate, a.recordstatus
	into vpostdate, vrecstat
	from genjournal a
	where a.genjournalid = vid;

