--
-- Definition of procedure `smlive`.`ApproveOnleaveTrans`
--

DROP PROCEDURE IF EXISTS `smlive`.`ApproveOnleaveTrans`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`smlive`@`localhost` PROCEDURE  `smlive`.`ApproveOnleaveTrans`(vonleavetransid integer,vlastupdateby varchar(50))
BEGIN
	declare orecordstatus, vshortstat, vlongstat text;
	declare vcurdate,vtakefrom,vtaketo,vjoindate datetime;
	declare vlastvalue,vid,vschedid,vnextstat,vonleavetypeid,vsnroid,vcutimax int;

  select a.employeeid, a.recordstatus, d.shortstat, d.longstat, a.datefrom, a.dateto, a.onleavetypeid, c.snroid,
    b.joindate,c.cutimax
	into vid, orecordstatus, vshortstat, vlongstat, vtakefrom, vtaketo, vonleavetypeid,vsnroid,
    vjoindate,vcutimax
	from onleavetrans a
	inner join employee b on b.employeeid = a.employeeid
	inner join onleavetype c on c.onleavetypeid = a.onleavetypeid
	inner join absstatus d on d.absstatusid = c.absstatusid
	where onleavetransid = vonleavetransid;

  select getwfrecstatbycreated('apponleavetrans',orecordstatus,vlastupdateby)
	into vnextstat;

	if getwfcomparemax('apponleavetrans',vnextstat, vlastupdateby) > 0 then
	  set vcurdate = vtakefrom;
	  while vcurdate <= vtaketo do
            select ifnull(count(1),0)
      into vlastvalue
      from employeeonleave
      where onleaveid = vonleavetypeid and employeeid = vid and date(periodefrom) <= date(vcurdate) and date(periodeto) >= date(vcurdate);

      if vlastvalue > 0 then
        select lastvalue
        into vlastvalue
        from employeeonleave
      where onleaveid = vonleavetypeid and employeeid = vid and date(periodefrom) <= date(vcurdate) and date(periodeto) >= date(vcurdate);

        if vlastvalue > 1 then
          set vlastvalue = vlastvalue - 1;
        else
            CALL pRaiseError('<cutihabis>');
        end if;

        update employeeonleave
        set lastvalue = vlastvalue
      where onleaveid = vonleavetypeid and employeeid = vid and date(periodefrom) <= date(vcurdate) and date(periodeto) >= date(vcurdate);

		    set vschedid = getempschedbyempdate(vid,vcurdate);
		    call updatereportinbyempdate(vid,vcurdate,vshortstat,vschedid);
		    call updatereportoutbyempdate(vid,vcurdate,vshortstat);

      else
        if vlastvalue = 0 then
            values (vid,vonleavetypeid,concat(year(vcurdate),'-01-01'),
              concat(year(vcurdate),'-12-31'),vcutimax-1,1);
		        set vschedid = getempschedbyempdate(vid,vcurdate);
		        call updatereportinbyempdate(vid,vcurdate,vshortstat,vschedid);
		        call updatereportoutbyempdate(vid,vcurdate,vshortstat);
        end if;
      end if;

		  		  set vcurdate = date_add(vcurdate,interval 1 day);
	  end while;
	end if;

	update onleavetrans
	set recordstatus=vnextstat,nodocument=ifnull(nodocument,getrunno(vsnroid,vtakefrom))
	where onleavetransid=vonleavetransid;

END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

