DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`smlive`@`localhost` PROCEDURE  `smlive`.`ApprovePettyCash`(vid integer, vlastupdateby varchar(50))
BEGIN
  declare vsnroid, vnextstat, vlid, vstat, vaccount, vcaccount,vrecstat,vempid,visreal,vcashsnroid integer;
  declare vmsgstart, vmsgend,vreferenceno varchar(50);

  select recordstatus, accountid, isrealitation
  into vrecstat, vempid, visreal
  from pettycash
  where pettycashid = vid;

  select paramvalue
  into vstat
  from parameter
  where upper(paramname) = upper('statpettystartmoney');

  select paramvalue
  into vaccount
  from parameter
  where upper(paramname) = upper('accountdebetstartmoney');

  select paramvalue
  into vmsgstart
  from parameter
  where upper(paramname) = upper('msgstartmoney');

  select paramvalue
  into vmsgend
  from parameter
  where upper(paramname) = upper('msgrepmoney');

  select snroid
  into vsnroid
  from snro
  where upper(description) = ('Petty Cash');

select snroid
  into vcashsnroid
  from snro
  where upper(description) = ('Cash In Flow');

  select getwfrecstatbycreated('apppettycash',vrecstat,vlastupdateby)
	into vnextstat;

  if checkaccperiod(now()) > 0 then
		if GetWfBefStatByCreated('apppettycash',vrecstat,vlastupdateby) > 0 then

           update pettycash
       set pettycashno = ifnull(pettycashno, getrunno(vsnroid,pettycashdate)),
				    recordstatus=vnextstat, postdate = now()
       where pettycashid = vid;

  if visreal = 1 then

			if getwfcomparemax('apppettycash',vnextstat,vlastupdateby) = 1 then

                        
        select pettycashno,pettycashdate,vmsgend,postdate,1
        from pettycash
        where pettycashid = vid;

        select last_insert_id()
        into vlid;

        select vlid,a.accountid,a.debit,a.credit,a.currencyid,a.projectid
        from pettycashdetail a
        where pettycashid = vid;

        select vlid,vempid,0, a.pettycashval,a.currencyid
        from pettycash a
        where pettycashid = vid;

        call approvejournal(vlid,vlastupdateby);

                select pettycashno
        into vreferenceno
        from pettycash
        where pettycashid = vid;

        select getrunno(vcashsnroid,pettycashdate), ifnull(a.debit,0),a.pettycashdate
        from pettycashdetail a
        where pettycashid = vid and accountid = vaccount;

      else

                                if (vnextstat = vstat) and (vempid > 0) then

          select a.pettycashno,a.pettycashdate,vmsgstart,a.postdate,1
          from pettycash a
          where pettycashid = vid;

          select last_insert_id()
          into vlid;

          select vlid,vempid,0, a.pettycashval,a.currencyid
          from pettycash a
          where pettycashid = vid;

          select vlid,vaccount,a.pettycashval,0,a.currencyid
          from pettycash a
          where pettycashid = vid;

          call approvejournal(vlid,vlastupdateby);

                    select pettycashno
        into vreferenceno
        from pettycash
        where pettycashid = vid;

        select getrunno(vcashsnroid,pettycashdate), ifnull(a.debit,0),a.pettycashdate
        from pettycashdetail a
        where pettycashid = vid and accountid = vaccount;

        end if;
      end if;
end if;

  if visreal = 0 then
        select pettycashno,pettycashdate,vmsgend,postdate,1
        from pettycash
        where pettycashid = vid;

        select last_insert_id()
        into vlid;

        select vlid,a.accountid,a.debit,a.credit,a.currencyid,a.projectid
        from pettycashdetail a
        where pettycashid = vid;

        select vlid,a.accountid,0, a.pettycashval,a.currencyid
        from pettycash a
        where pettycashid = vid;

        call approvejournal(vlid,vlastupdateby);

        update pettycash
       set recordstatus=getwfmaxstatbywfname('apppettycash')
       where pettycashid = vid;

                select pettycashno
        into vreferenceno
        from pettycash
        where pettycashid = vid;

        select getrunno(vcashsnroid,pettycashdate), vreferenceno, ifnull(a.debit,0), a.pettycashdate
        from pettycashdetail a
        where pettycashid = vid and accountid = vaccount;

end if;




    else
      CALL pRaiseError('<flowapppr>');
    end if;
  else
    CALL pRaiseError('<periodover>');
  end if;
END $$
