--
-- Definition of procedure `smlive`.`ApprovePO`
--

DROP PROCEDURE IF EXISTS `smlive`.`ApprovePO`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`smlive`@`localhost` PROCEDURE  `smlive`.`ApprovePO`(vid integer, vlastupdateby varchar(50))
BEGIN
	declare vsnroid,vrecstat,vnextstat,vtypeid,vpid,vprice,vcurrid,vunder,
  vover,k,vabid,vpoid,vprdid integer;
	declare vpostdate,vpodate date;
declare vpoqty,vqtyres decimal(30,4);
DECLARE done INT DEFAULT 0;
DECLARE cur1 CURSOR FOR SELECT productid,netprice,currencyid,underdelvtol,overdelvtol,
  addressbookid,podetailid,prdetailid,poqty
  FROM podetail a
  inner join poheader b on b.poheaderid = a.poheaderid
  where a.poheaderid = vid;
DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET done=1;

	select abc.postdate, abc.docdate, abc.recordstatus
	into vpostdate, vpodate, vrecstat
	from poheader abc
	where abc.poheaderid = vid;

	select getwfrecstatbycreated('apppo',vrecstat,vlastupdateby)
	into vnextstat;

select a.snroid, a.prodtranstypeid
	into vsnroid,vtypeid
	from prodtranstype a
	where upper(a.prodtranscode) = upper('PO');

select ifnull(count(1),0)
into k
from podetail
where poheaderid = vid;

if k > 0 then


	if checkaccperiod(vpostdate) > 0 then
		if GetWfBefStatByCreated('apppo',vrecstat,vlastupdateby) > 0 then
	   		update poheader
	   		set pono = ifnull(pono,getrunno(vsnroid,vpodate)),
				recordstatus=vnextstat
	   		where poheaderid = vid;


  OPEN cur1;
  read_loop: LOOP
      
      FETCH cur1 INTO vpid,vprice,vcurrid,vunder,vover,vabid,vpoid,vprdid,vpoqty;
      IF done THEN
        LEAVE read_loop;
      END IF;

      select ifnull(qty,0) - ifnull(poqty,0)
      into vqtyres
      from prmaterial
      where prmaterialid = vprdid and productid = vpid;

if getwfcomparemax('apppo',vnextstat,vlastupdateby) = 1 then

      if (vqtyres >= vpoqty) then

        values (vabid,vpid,vunder,vover,vprice,vcurrid,vpodate);

      update prmaterial
      set poqty = poqty + vpoqty
      where prmaterialid = vprdid and productid = vpid;

      else
        set done=2;
        CALL pRaiseError('<ipoover>');
        LEAVE read_loop;
      end if;
	end if;

  END LOOP;
  CLOSE cur1;
else
CALL pRaiseError('<flowapppr>');
end if;
		end if;

else
  CALL pRaiseError('<detailempty>');
end if;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

