--
-- Definition of procedure `smlive`.`ApprovePR`
--

DROP PROCEDURE IF EXISTS `smlive`.`ApprovePR`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`smlive`@`localhost` PROCEDURE  `smlive`.`ApprovePR`(vid integer, vlastupdateby varchar(50))
BEGIN
	declare vsnroid,vrecstat,vnextstat,vslocid,vtypeid,vuomid,vuomgudangid,vproductid,visd, vpoid, vpodetailid,
    vsid,visasset,vgrid,vcurrencyid,k integer;
	declare vpostdate,vdate,vbuydate date;
declare vconv,vcurrstock,vqty,vqtyres,vbuyprice decimal(20,4);
	declare vpodate date;
DECLARE done INT DEFAULT 0;
DECLARE cur1 CURSOR FOR SELECT productid,qty,unitofmeasureid,deliveryadvicedetailid,prmaterialid
  FROM prmaterial where prheaderid = vid;
DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET done=1;

	select abc.prdate, abc.recordstatus
	into vpodate, vrecstat
	from prheader abc
	where abc.prheaderid = vid;

	select getwfrecstatbycreated('apppr',vrecstat,vlastupdateby)
	into vnextstat;

select a.snroid, a.prodtranstypeid
	into vsnroid,vtypeid
	from prodtranstype a
	where upper(a.prodtranscode) = upper('PR');

select ifnull(count(1),0)
into k
from prmaterial
where prheaderid = vid;

if k > 0 then

if checkaccperiod(vpodate) > 0 then
		if GetWfBefStatByCreated('apppr',vrecstat,vlastupdateby) > 0 then
	   		update prheader
	   		set prno = ifnull(prno, getrunno(vsnroid,vpodate)),
				  recordstatus=vnextstat
	   		where prheaderid = vid;

        OPEN cur1;
read_loop: LOOP
      
      FETCH cur1 INTO vproductid,vqty,vuomid,vpodetailid,visd;
      IF done THEN
        LEAVE read_loop;
      END IF;

select qty - ifnull(prqty,0) - ifnull(giqty,0)
      into vqtyres
      from deliveryadvicedetail
      where deliveryadvicedetailid = vpodetailid;

      if vqtyres >= vqty then

        if getwfcomparemax('apppr',vnextstat,vlastupdateby) = 1 then

      update deliveryadvicedetail
      set prqty=prqty + vqty
      where deliveryadvicedetailid = vpodetailid;
        end if;

else
        set done=2;
        CALL pRaiseError('<iprover>');
        LEAVE read_loop;
      end if;

END LOOP;
CLOSE cur1;

else
CALL pRaiseError('<flowapppr>');
		end if;
else
CALL pRaiseError('<periodover>');
end if;

else
  CALL pRaiseError('<detailempty>');
end if;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

