CREATE DEFINER=`smlive`@`localhost` PROCEDURE  `smlive`.`ApproveSickTrans`(vsicktransid integer,vlastupdateby varchar(50))
BEGIN
	declare orecordstatus, vshortstat, vlongstat text;
	declare vcurdate,vtakefrom,vtaketo datetime;
declare vsickdate date;
	declare vid,vschedid,vsnroid,vnextstat,vrecstat int;

	select a.employeeid, a.recordstatus, d.shortstat, d.longstat, a.takedatefrom, a.takedateto, c.sicksnroid,a.sickdate
	into vid, vrecstat, vshortstat, vlongstat, vtakefrom, vtaketo, vsnroid, vsickdate
	from sicktrans a
	inner join employee b on b.employeeid = a.employeeid
	inner join employeetype c on c.employeetypeid = b.employeetypeid
	inner join absstatus d on d.absstatusid = c.sickstatusid
	where sicktransid = vsicktransid;

	select getwfrecstatbycreated('appsicktrans',vrecstat,vlastupdateby)
	into vnextstat;

  if GetWfBefStatByCreated('appsicktrans',vrecstat,vlastupdateby) > 0 then

	  if getwfcomparemax('appsicktrans',vnextstat,vlastupdateby) = 1 then
	    set vcurdate = vtakefrom;
	    while vcurdate <= vtaketo do
        set vschedid = getempschedbyempdate(vid,vcurdate);
		    call updatereportinbyempdate(vid,vcurdate,vshortstat,vschedid);
		    call updatereportoutbyempdate(vid,vcurdate,vshortstat);
		    
		    set vcurdate = date_add(vcurdate,interval 1 day);
	    end while;
    end if;
update sicktrans
	set recordstatus=vnextstat,
  nodocument=ifnull(nodocument,getrunno(vsnroid,vsickdate))
	where sicktransid=vsicktransid;
	end if;



END $$
