CREATE DEFINER=`smlive`@`localhost` PROCEDURE  `smlive`.`ApproveTroubleTicket`(vid integer, vlastupdateby varchar(50))
BEGIN
  declare vsnroid,vttid,vttstatusid integer;
  select a.snroid
	into vsnroid
	from snro a
	where upper(a.description) = upper('SPK No');

  select a.snroid
	into vttid
	from snro a
	where upper(a.description) = upper('Trouble Ticket No');

  update troubleticket
  set troubleticketno = ifnull(troubleticketno,getrunno(vttid,now()))
  where troubleticketid = vid;

  select b.iscount
  into vttstatusid
  from troubleticket a
  inner join troubleticketstatus b on b.troubleticketstatusid = a.troubleticketstatusid
  where troubleticketid = vid;

  select vid,a.useraccessid,a.description,a.startdate,a.enddate,
  case when vttstatusid = 1 then getrunno(vsnroid,now()) else '' end,a.troubleticketstatusid
  from troubleticket a
  where troubleticketid = vid;
END $$
