CREATE DEFINER=`smlive`@`localhost` PROCEDURE  `smlive`.`CellBroadcast`(vmessage text)
BEGIN
	declare done int default 0;
	declare vhp text;
	declare cur1 cursor for
		select a.hpno
		from memberhp a
		where a.mainhp = 1;
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;

