--
-- Definition of procedure `smlive`.`checkstockmkios`
--

DROP PROCEDURE IF EXISTS `smlive`.`checkstockmkios`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`smlive`@`localhost` PROCEDURE  `smlive`.`checkstockmkios`(vvouchername varchar(50),
vmkiosreturn text)
BEGIN
	declare vminstock integer;
	declare vstock integer;
	set vstock = replace(split_str(vmkiosreturn,'=',2),'.','');
	update voucherprice
	set stock = vstock
	where lower(vouchername) = lower(vvouchername);	
	
	select minstock
	into vminstock
	from voucherprice
	where lower(vouchername) = lower(vvouchername);

	if (vstock <= vminstock) then
		values (sysdate(), getparamvalue('stockymnoti0'), concat('Stock ',vvouchername,' = ', vstock), 
			getparamvalue('intymeng'), 1);
		values (sysdate(), getparamvalue('stockymnoti1'), concat('Stock ',vvouchername,' = ', vstock), 
			getparamvalue('intymeng'), 1);
	end if;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

