--
-- Definition of procedure `smlive`.`EmployeeBroadcast`
--

DROP PROCEDURE IF EXISTS `smlive`.`EmployeeBroadcast`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`smlive`@`localhost` PROCEDURE  `smlive`.`EmployeeBroadcast`(vmessage text)
BEGIN
	declare done int default 0;
	declare vhp text;
	declare cur1 cursor for
		select a.hpno
		from memberhp a 
		inner join voucheragent b on b.voucheragentid = a.voucheragentid
		inner join employee c on c.addressbookid = b.addressbookid
		inner join addressbook d on d.addressbookid = c.addressbookid and d.isemployee=1
		where a.mainhp=1;
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;

	open cur1;
	repeat
		fetch cur1 into vhp;
		if not done then
			if (vmessage <> '') then
    				values (vmessage, vhp, getphonesid(vhp),1);
			end if;
		end if;
	until done end repeat;
	close cur1;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

--
-- Definition of procedure `smlive`.`EmptyProcess`
--

DROP PROCEDURE IF EXISTS `smlive`.`EmptyProcess`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`smlive`@`localhost` PROCEDURE  `smlive`.`EmptyProcess`()
BEGIN
	declare done int default 0;
	declare yinid int;
	declare textdec text;
	declare hpw text;
	declare vsep text;
	declare sc text;
	declare i int;
	declare cur1 cursor for
		select a.yminboxid, a.textdecoded, b.hpword, b.valuesep,b.sourcecode
		from yminbox a inner join 
		vouchersource b on lower(b.idymsource) = lower(a.ymsender)
		where (lower(a.textdecoded) like concat('%',lower(b.emptyword), '%') or
		lower(a.textdecoded) like concat('%',lower(b.troubleword), '%')) and 
		a.recordstatus = 1;
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;

	open cur1;
	repeat
		fetch cur1 into yinid,textdec,hpw,vsep,sc;
		if not done then
			delete from yminbox
			where yminboxid = yinid; 
			select vouchertrxid
			into i
			from vouchertrx
			where hpdest = gethpvalue(textdec,vsep,hpw) and
			sourcetrx = replace(getscvalue(textdec,vsep,sc),'/nasional','') and
 			recordstatus = 1;
			call refundtrx(i);	
		end if;
	until done end repeat;
	close cur1;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

