--
-- Definition of procedure `smlive`.`FixAbsTrans`
--

DROP PROCEDURE IF EXISTS `smlive`.`FixAbsTrans`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`smlive`@`localhost` PROCEDURE  `smlive`.`FixAbsTrans`(vid integer,vinid integer,voutid integer,
vreason varchar(50))
BEGIN
  declare vdate date;
  declare vstatusin, vstatusout varchar(5);
  declare vempid,vschedid integer;

  select date(absdate),employeeid,absscheduleid
  into vdate,vempid,vschedid
  from reportperday
  where reportperdayid = vid;

  select shortstat
  into vstatusin
  from absstatus
  where absstatusid = vinid;

  select shortstat
  into vstatusout
  from absstatus
  where absstatusid = voutid;

  update reportperday
  set statusin = vstatusin, statusout = vstatusout, reason = vreason
  where reportperdayid = vid;

  call updatereportinbyempdate(vempid,vdate,vstatusin,vschedid);
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

