CREATE DEFINER=`smlive`@`localhost` PROCEDURE  `smlive`.`GenerateGIDA`(vid integer, vhid integer)
BEGIN
  declare vislot,p1,vproductid,vuomid,vslocid,vdadetailid int;
  DECLARE done INT DEFAULT 0;
  declare vqty decimal(20,4);
  DECLARE cur1 CURSOR FOR
    SELECT productid, qty - ifnull(giqty,0), unitofmeasureid, deliveryadvicedetailid
    from deliveryadvicedetail
    where deliveryadviceid = vid and qty > giqty;
  DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET done=1;

	delete from gidetail
  where giheaderid = vhid;

  

  OPEN cur1;
  read_loop: LOOP
      FETCH cur1 INTO vproductid,vqty,vuomid,vdadetailid;
      IF done THEN
        LEAVE read_loop;
      END IF;

      select ifnull(isautolot,0)
      into vislot
      from productplant a
      where productid = vproductid;

      
      if (vislot = 0) then
            values (vhid,vproductid,vqty,vuomid,vdadetailid);

      else
        
        set p1=0;
        label1: LOOP
          SET p1 = p1 + 1;
          IF p1 <= vqty THEN
            values (vhid,vproductid,1,vuomid,vdadetailid);
          else
           LEAVE label1;
          END IF;
        END LOOP label1;

      end if;

  END LOOP;
  CLOSE cur1;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

