--
-- Definition of procedure `smlive`.`grossup`
--

DROP PROCEDURE IF EXISTS `smlive`.`grossup`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`smlive`@`localhost` PROCEDURE  `smlive`.`grossup`(
inout vtunjanganpph decimal(30,4),
vtotalbebanpajakrutinperusahaan decimal(30,4),
vtotalbebanpajakrutinpekerja decimal(30,4),
vptkp decimal(30,4),
inout vbrutosetahun decimal(30,4),
inout vbiayajabatansetahun decimal(30,4),
inout vnettosetahun decimal(30,4),
inout vpkp decimal(30,4)
)
BEGIN
  declare vtotal,vnettosetahun,vminvalue,vmaxvalue,vtaxvalue,
    vsisa, vpphsebulan decimal(30,4);

  SET max_sp_recursion_depth=50;

  set vbrutosetahun = ifnull(((ifnull(vtotalbebanpajakrutinperusahaan,0)+ifnull(vtunjanganpph,0))*12),0);
  set vbiayajabatansetahun = ifnull(
  (
    ifnull
      (
        getparamvalue('percenttaxcost'),0
      ) *
    ifnull(
      vbrutosetahun,0
    ) / 100
  ),0);
  if vbiayajabatansetahun > getparamvalue('taxcostlimit') then
    set vbiayajabatansetahun = ifnull(getparamvalue('taxcostlimit'),0);
  else
    set vbiayajabatansetahun = ifnull(
    (
      ifnull
      (
        getparamvalue('percenttaxcost'),0
      ) *
    ifnull(
      vbrutosetahun,0
    ) / 100
    ),0);
  end if;
  set vnettosetahun = ifnull(ifnull(vbrutosetahun,0) - (ifnull(vtotalbebanpajakrutinpekerja,0) * 12) -
    ifnull(vbiayajabatansetahun,0),0);

  if vnettosetahun > vptkp then
    set vpkp = ifnull(truncate(ifnull(vnettosetahun,0)-ifnull(vptkp,0),-3),0);
  else
    set vpkp = 0;
  end if;

  set vsisa = ifnull(vpkp,0);
  set vtotal = 0;

  BLOCK2 : begin
          declare no_more_rows1 int default 0;
          DECLARE cur3 CURSOR FOR
            SELECT a.minvalue, a.maxvalue, a.valuepercent
            FROM taxwageprogressif a order by a.minvalue;
          declare continue handler for not found
            set no_more_rows1 = 1;

          OPEN cur3;
          read_loop3: LOOP

            FETCH cur3 INTO vminvalue,vmaxvalue,vtaxvalue;
            IF no_more_rows1 THEN
              LEAVE read_loop3;
            END IF;
            if (vsisa > vmaxvalue) then
              set vtotal = vtotal + (vtaxvalue * vmaxvalue/100);
              set vsisa = vsisa - vmaxvalue;
            else
              if (vsisa >= vminvalue) and (vsisa < vmaxvalue) then
                set vtotal = vtotal + (vtaxvalue * vsisa/100);
                set vsisa = 0;
              else
                if (vsisa <= vminvalue) then
                  set vtotal = vtotal + (vtaxvalue * vsisa/100);
                  set vsisa = 0;
                else
                  if (vsisa = 0) then
                    leave read_loop3;
                  end if;
                end if;
              end if;
            end if;


            END LOOP;
            CLOSE cur3;

        end BLOCK2;

  set vpphsebulan = ifnull(vtotal / 12,0);



  if vpphsebulan <> vtunjanganpph then
    set vtunjanganpph = ifnull(vpphsebulan,0);
    call grossup(vtunjanganpph,
vtotalbebanpajakrutinperusahaan,
vtotalbebanpajakrutinpekerja,
vptkp,
@vbrutosetahun,
@vbiayajabatansetahun,
@vnettosetahun,
@vpkp);
  else
    set vtunjanganpph = ifnull(vpphsebulan,0);
  end if;

END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

