--
-- Definition of procedure `smlive`.`InsertAbsTrans`
--

DROP PROCEDURE IF EXISTS `smlive`.`InsertAbsTrans`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`smlive`@`localhost` PROCEDURE  `smlive`.`InsertAbsTrans`(vemployeeid integer, vdate datetime,
vmachineid integer, vmessages varchar(50))
BEGIN
	declare vstatus,vstatin,vstatout varchar(50);
	declare vid,vschedid,vabsstat,vitimein,vitimeout int;
	declare vsdate,vsdate1 datetime;

	set vsdate = vdate;
	set vschedid = getempschedbyempdate(vemployeeid,vsdate);
	set vstatus = getabsrulestatusbyschedid(vschedid,vsdate);
	if (vstatus is null) then
		set vsdate=date_sub(vdate,interval 1 day);
		set vschedid=getempschedbyempdate(vemployeeid,vsdate);
		set vstatus=getabsrulestatusbyschedid(vschedid,vsdate);
		call updatereportoutbyempdate(vemployeeid,vsdate,vstatus);		
	else
		
		select isin
		into vid
		from absstatus
		where upper(shortstat) = upper(vstatus);

		if vid = 0 then
			select count(1) 
			into vid
			from reportperday
			where day(absdate)=day(vsdate) and month(absdate)=month(vsdate) and
				year(absdate)=year(vsdate) and employeeid=vemployeeid;

			if (vid=0) then			
				set vsdate=date_sub(vdate,interval 1 day);
				set vschedid=getempschedbyempdate(vemployeeid,vsdate);
				set vstatus=getabsrulestatusbyschedid(vschedid,vsdate);
			else
				select absdate
				into vsdate1
				from reportperday
				where day(absdate)=day(vsdate) and month(absdate)=month(absdate) and
				year(absdate)=year(absdate) and employeeid=vemployeeid;

				if (vsdate < vsdate1) then
					set vsdate=date_sub(vdate,interval 1 day);
					set vschedid=getempschedbyempdate(vemployeeid,vsdate);
					set vstatus=getabsrulestatusbyschedid(vschedid,vsdate);
				end if;
			end if;
			call updatereportoutbyempdate(vemployeeid,vsdate,vstatus);
		else
			call updatereportinbyempdate(vemployeeid,vsdate,vstatus,vschedid);
			call updatereportjamsostekbyempdate(vemployeeid,vsdate,vstatus);
		end if;	
	end if;

	select longstat
	into vstatus
	from absstatus
	where upper(shortstat) = upper(vstatus);

	values (vemployeeid,getempnamebyempid(vemployeeid),getnewnikbyempid(vemployeeid),getoldnikbyempid(vemployeeid),getdivisionbyempid(vemployeeid),vschedid,
		getschednamebyschedid(vschedid),vdate,vmachineid,getusernamebyuserid(vmachineid),vstatus,vmessages);

END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

--
-- Definition of procedure `smlive`.`InsertAddress`
--

DROP PROCEDURE IF EXISTS `smlive`.`InsertAddress`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`smlive`@`localhost` PROCEDURE  `smlive`.`InsertAddress`(
vaddressid integer,vaddressbookid integer, vaddresstypeid integer, vaddressname varchar(50), vrt varchar(5), 
vrw varchar(5), vcityid integer, vkelurahanid integer, vsubdistrictid integer, vrecordstatus integer, 
vcreatedby integer)
BEGIN
	declare oaddresstypeid,oaddressname,ort,orw,ocityid,okelurahanid,osubdistrictid,orecordstatus text;
	if (vaddressid > 0) then
		select addresstypeid,addressname,rt,rw,cityid,kelurahanid,subdistrictid,recordstatus
		into oaddresstypeid,oaddressname,ort,orw,ocityid,okelurahanid,osubdistrictid,orecordstatus
		from address
		where addressid = vaddressid;
  		call inserttranslog(concat('update address addressid=',vaddressid, 
		' addresstypeid=',oaddresstypeid,'>',vaddresstypeid,
		' addressname=',oaddressname,'>',vaddressname,
		' rt=',ort,'>',vrt,
		' rw=',orw,'>',vrw,
		' cityid=',ocityid,'>',vcityid,
		' kelurahanid=',okelurahanid,'>',vkelurahanid,
		' subdistrictid=',osubdistrictid,'>',vsubdistrictid,
		' recordstatus=',orecordstatus,'>',vrecordstatus,
		' by=',vcreatedby,' date=',sysdate()));
		update address 
		set addresstypeid=vaddresstypeid,addressname=vaddressname,rt=vrt,rw=vrw,
		cityid=vcityid,kelurahanid=vkelurahanid,subdistrictid=vsubdistrictid,recordstatus = vrecordstatus
		where addressid = vaddressid;
	else

		values (vaddressbookid,vaddresstypeid,vaddressname,vrt,vrw,vcityid,vkelurahanid,vsubdistrictid,1);

        	call inserttranslog(concat('insert address addressbookid=',vaddressbookid,
