/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`smlive`@`localhost` PROCEDURE  `smlive`.`InsertEmployee`(vemployeename varchar(50),
vorgstructureid integer, vpositionid integer,vemployeetypeid integer,
vsexid integer, vbirthcityid integer, vbirthdate date,
vreligionid integer, vmaritalstatusid integer, vreferenceby varchar(50),
vjoindate date, vemployeestatusid integer, vistrial integer,vdplkno varchar(20), vcreatedby integer, vlevelorg integer,
vemail varchar(50),vphoneno varchar(20),valternateemail varchar(50),vhpno varchar(20),
vtaxno varchar(50),vhpno2 varchar(20),vmedical text,vaccountno varchar(50),
vresigndate date)
BEGIN
	declare k,l integer;
  declare vrunno,ocompany,oposition varchar(50);
	call insertaddressbook(vemployeename, 0, 1, 0, 0, 0, 0, 0, vcreatedby);
	set k=last_insert_id();

	select snroid
	into l
	from employeetype a
	where a.employeetypeid = vemployeetypeid;

  set vrunno = getrunno(l,now());

select companyname
into ocompany
from company
limit 1;

select positionname
into oposition
from `position`
where positionid = vpositionid;


		employeetypeid,sexid, birthcityid,birthdate,religionid,
		maritalstatusid,referenceby,joindate,employeestatusid,
		istrial,dplkno,levelorgid,email,phoneno,alternateemail,hpno,taxno,hpno2,medical,
    accountno,resigndate)
	values (vemployeename,k,concat(vrunno,date_format(vbirthdate,'%y'),date_format(vjoindate,'%y')),
    vrunno,vorgstructureid,vpositionid,
		vemployeetypeid,vsexid,vbirthcityid,vbirthdate,vreligionid,
		vmaritalstatusid,vreferenceby,vjoindate,vemployeestatusid,
		vistrial,vdplkno,vlevelorg,vemail,vphoneno,valternateemail,vhpno,vtaxno,vhpno2,
    vmedical,vaccountno,vresigndate);
	set k=last_insert_id();

    values (k,ocompany,oposition,concat(date_format(now(),'%d-%M-%Y'),' s/d sekarang'),1,1);

	update employee
	set barcode=concat('barcode-',vrunno,'.jpg'),
	photo=concat('photo-',vrunno,'.jpg')
	where employeeid = k;

END $$
