CREATE DEFINER=`smlive`@`localhost` PROCEDURE  `smlive`.`InsertGroupMenu`(vgroupmenuid integer, 
vmenuaccessid varchar(50), vgroupaccessid varchar(50), visread integer, viswrite integer, 
visprint integer, visreject integer,vispost integer, visupload integer, visdownload integer, 
vrecordstatus integer)
BEGIN
		declare ogroupaccessid,omenuaccessid,oisread,oiswrite, 
			oisprint,oisreject,oispost,oisupload,oisdownload text;
	if vgroupmenuid > 0 then
		select groupaccessid,menuaccessid,isread,iswrite, 
			isprint,isreject,ispost,isupload,isdownload
		into ogroupaccessid,omenuaccessid,oisread,oiswrite, 
			oisprint,oisreject,oispost,oisupload,oisdownload
		from groupmenu
		where groupmenuid = vgroupmenuid;
  		call inserttranslog(concat('update groupmenu groupmenuid=',vgroupmenuid,
			' groupaccessid=',ogroupaccessid,'>',vgroupaccessid,
			' menuaccessid=',omenuaccessid,'>',vmenuaccessid,
			' isread=',oisread,'>',visread,
			' iswrite=',oiswrite,'>',viswrite,
			' isprint=',oisprint,'>',visprint,
			' isreject=',oisreject,'>',visreject,
			' ispost=',oispost,'>',vispost,
			' isupload=',oisupload,'>',visupload,
			' isdownload=',oisdownload,'>',visdownload,
			' by=',vlastupdateby,' date=',sysdate()));

		update groupmenu 
		set menuaccessid = vmenuaccessid, 
	    	groupaccessid = vgroupaccessid, isread = visread,
	    	iswrite = viswrite, isprint = visprint, isreject = visreject,
	    	ispost = vispost, isupload = visupload, isdownload = visdownload,
	    	recordstatus = vrecordstatus
		where groupmenuid = vgroupmenuid;
	else
			ispost, isupload, isdownload, recordstatus)
		values (vmenuaccessid, vgroupaccessid, visread, viswrite, visprint, visreject,
			vispost, visupload, visdownload, vrecordstatus);
	end if;
END $$
