/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`smlive`@`localhost` PROCEDURE  `smlive`.`InsertLockerCompare`(vemployeeid integer,vlockerkeyid integer,
vabsdate datetime,vhourin varchar(5),vabsscheduleid integer,vstatusin varchar(5))
BEGIN
	declare vid,vid1 integer;
	declare vin varchar(5);

	select count(1)
	into vid
	from lockercompare 
	where employeeid = vemployeeid and date(absdate) = date(vabsdate);

	if vid < 1 then
			absscheduleid,schedulename,
			transdate,takedate,checkdate,returndate)
		values (vemployeeid,getempnamebyempid(vemployeeid),getoldnikbyempid(vemployeeid),
			getnewnikbyempid(vemployeeid),getempstructbyempid(vemployeeid),
			vabsscheduleid,getschednamebyschedid(vabsscheduleid),
			vabsdate,'00:00','00:00','00:00');
	else
		update lockercompare
		set takedate = vabsdate, absscheduleid = vabsscheduleid,schedulename=getschednamebyschedid(vabsscheduleid),
		fullname = getempnamebyempid(vemployeeid),oldnik = getoldnikbyempid(vemployeeid),
		newnik = getnewnikbyempid(vemployeeid),fulldivision =getempstructbyempid(vemployeeid) 
		where employeeid = vemployeeid and date(absdate) = date(vabsdate);
	end if;
END $$
