--
-- Definition of procedure `smlive`.`InsertOrgStructure`
--

DROP PROCEDURE IF EXISTS `smlive`.`InsertOrgStructure`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`smlive`@`localhost` PROCEDURE  `smlive`.`InsertOrgStructure`(voldstrucname varchar(200), vstructurename varchar(200),
vparentid varchar(200),vcreatedby integer)
BEGIN
	declare ostructurename,oparentid text;
	declare i integer;
	if voldstrucname <> '' then
		select orgstructureid
		into i
		from orgstructure
		where upper(structurename) = upper(voldstrucname);
	else
		select orgstructureid
		into i
		from orgstructure
		where upper(structurename) = upper(vstructurename);
	end if;

	if (i > 0) then
		
		select structurename,parentid
		into ostructurename,oparentid
		from orgstructure
		where orgstructureid = i;
		values (concat('update orgstructure orgstructureid=',i,
		' structurename=',ostructurename,'>',vstructurename,
		' parentid=',oparentid,'>',vparentid,
		' by=',vcreatedby,' date=',sysdate()));

		update orgstructure
		set structurename = vstructurename, parentid = vparentid,recordstatus=1
		where orgstructureid = i;
	else
		values (concat('insert orgstructure structurename=',vstructurename,
			' parentid=',vparentid,
			' by=',vcreatedby,' date=',sysdate()));

		values (vstructurename,vparentid,1);
	end if;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

