--
-- Definition of procedure `smlive`.`InsertReportPerDay`
--

DROP PROCEDURE IF EXISTS `smlive`.`InsertReportPerDay`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`smlive`@`localhost` PROCEDURE  `smlive`.`InsertReportPerDay`(vemployeeid integer,
vabsdate datetime,vhourin varchar(5),vabsscheduleid integer,vstatusin varchar(5))
BEGIN
	declare vid,vid1 integer;
	declare vin varchar(5);

	select count(1)
	into vid
	from reportperday
	where employeeid = vemployeeid and date(absdate) = date(vabsdate);

	if vid < 1 then
			hourout,statusin,statusout)
		values (vemployeeid,vabsdate,vhourin,vabsscheduleid,getschednamebyschedid(vabsscheduleid),getempnamebyempid(vemployeeid),getoldnikbyempid(vemployeeid),
			getnewnikbyempid(vemployeeid),getempstructbyempid(vemployeeid),'00:00',vstatusin,vstatusin);
	else
		select statusin
		into vin
		from reportperday 
		where employeeid = vemployeeid and date(absdate) = date(vabsdate);

		set vin = getnewstatusbyshortstat(vin, vstatusin);

		update reportperday
		set absdate = vabsdate,hourin = vhourin, statusin = vin, absscheduleid = vabsscheduleid,schedulename=getschednamebyschedid(vabsscheduleid),
		fullname = getempnamebyempid(vemployeeid),oldnik = getoldnikbyempid(vemployeeid),
		newnik = getnewnikbyempid(vemployeeid),fulldivision =getempstructbyempid(vemployeeid) 
		where employeeid = vemployeeid and date(absdate) = date(vabsdate);
	end if;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

