--
-- Definition of procedure `smlive`.`MKiosProcess`
--

DROP PROCEDURE IF EXISTS `smlive`.`MKiosProcess`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`smlive`@`localhost` PROCEDURE  `smlive`.`MKiosProcess`(vMkiosid int, vMkiosreturn text)
BEGIN
	declare vtrxid int;
	declare vid int;
	declare hps varchar(50);
	declare hpd varchar(50);
	declare deb decimal;
	declare idy varchar(50);
	declare trans decimal;
	declare selisih decimal;
	declare msg text;
	declare vchname text;

	select a.vouchertrxid, b.hpsender, b.idym, b.vouchername
	into vtrxid, hps, idy, vchname
	from mkios a inner join 
	vouchertrx b on b.vouchertrxid = a.vouchertrxid
	where mkiosid = vMkiosid;

	set msg = '';
	
	if (hps <> '') then
		select c.voucheragentid, a.hpdest, a.debet, a.saldo
		into vid, hpd, trans,selisih
		from vouchertrx a inner join
		memberhp b on b.hpno = a.hpsender and b.recordstatus = 1 inner join
		voucheragent c on c.voucheragentid = b.voucheragentid
		where a.vouchertrxid = vtrxid limit 1;

		if (lower(vMkiosreturn) like concat('%','berhasil','%')) then
			update vouchertrx
			set recordstatus = 3,trxend = sysdate(),
			    sn = replace(replace(replace(split_str(right(lower(vmkiosreturn), length(vmkiosreturn)-position('nomer seri' in lower(vmkiosreturn))+1),' ',3),'<',''),'>',''),'.','')
			where vouchertrxid = vtrxid; 

			set msg = concat(_utf8 'Berhasil ',hpd,' ',trans,' Saldo ',selisih,' ',getinfo());
		else
			set selisih = ifnull(getdeposit(vid),0) + ifnull(trans,0);
			update voucheragent
			set deposit = selisih
			where voucheragentid = vid;
		
			update vouchertrx
			set recordstatus=0,trxend = sysdate()
			where vouchertrxid = vtrxid;

			set msg = concat(_utf8 'Gagal ',hpd,' Saldo ', selisih,' ',getinfo());
		end if;
		if (msg <> '') then
			values (hps, msg, getphonesid(hps));
		end if;
	else
		if (idy <> '') then
			select c.voucheragentid, a.hpdest, a.debet, a.saldo 
			into vid, hpd, trans, selisih
			from vouchertrx a inner join
			memberym b on lower(b.idym) = lower(a.idym) and b.recordstatus = 1 inner join
			voucheragent c on c.voucheragentid = b.voucheragentid
			where a.vouchertrxid = vtrxid limit 1;

			if (lower(vMkiosreturn) like concat('%','berhasil','%')) then
				update vouchertrx
				set recordstatus = 3,trxend = sysdate(),
				    sn = replace(replace(replace(split_str(right(lower(vmkiosreturn), length(vmkiosreturn)-position('nomer seri' in lower(vmkiosreturn))+1),' ',3),'<',''),'>',''),'.','')
				where vouchertrxid = vtrxid; 

				set msg = concat(_utf8 'Berhasil ',hpd,' ',trans,' Saldo ',selisih,' ',getinfo());
			else
				set selisih = ifnull(getdeposit(vid),0) + ifnull(trans,0);
				update voucheragent
				set deposit = selisih
				where voucheragentid = vid;
		
				update vouchertrx
				set recordstatus=0,trxend = sysdate()
				where vouchertrxid = vtrxid;

				set msg = concat(_utf8 'Gagal ',hpd,' Saldo ', selisih,' ',getinfo());
			end if; 
			if (msg <> '') then
				values (idy, msg, getparamvalue('intymeng'), 1); 
				call checkstockmkios(vchname,vMkiosreturn);
			end if;
		end if;
	end if;
	if (msg <> '') then
		update mkios
		set mkiosreturn = vmkiosreturn, recordstatus=0
		where mkiosid = vmkiosid;
		call checkstockmkios(vchname,vMkiosreturn);
	end if;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

