--
-- Definition of procedure `smlive`.`payrollprocess`
--

DROP PROCEDURE IF EXISTS `smlive`.`payrollprocess`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`smlive`@`localhost` PROCEDURE  `smlive`.`payrollprocess`(vpayrollperiodid integer)
BEGIN
  declare vstartperiod,vendperiod,vstartdate,venddate,vjoindate date;
  declare vidgapok,vidjabatan,vidkhusus,vid,vwagetypeid,vcurrencyid,vcount,k,vfulldaywork,vdaywork,
    vempwageid integer;
  declare vreason varchar(50);
  declare vamount,vtotal,vpphsetahunrutin,vpphsetahunnonrutin decimal(30,4);

SET max_sp_recursion_depth=10;

  select startdate,enddate
  into vstartperiod,vendperiod
  from payrollperiod
  where payrollperiodid = vpayrollperiodid;

delete from translog;


  delete from employeewagedetail
where wagetypeid in
(
  select distinct a.wagetypeid
  from employeebenefitdetail a
  inner join employeebenefit b on b.employeebenefitid = a.employeebenefitid
  inner join wagetype c on c.wagetypeid = a.wagetypeid
  where a.isfinal = 1
)
and date(startdate) = date(vstartperiod) and
  date(enddate) = date(vendperiod);

  delete from employeetaxdetail
where wagetypeid in
(
  select distinct a.wagetypeid
  from employeebenefitdetail a
  inner join employeebenefit b on b.employeebenefitid = a.employeebenefitid
  inner join wagetype c on c.wagetypeid = a.wagetypeid
  where a.isfinal = 1
)
and date(startdate) = date(vstartperiod) and
  date(enddate) = date(vendperiod);

update employeetax
set taxvalue=0
where date(taxstartperiod) = date(vstartperiod) and
  date(taxendperiod) = date(vendperiod);

update employeewage
set wagevalue=0
where date(wagestartperiod) = date(vstartperiod) and
  date(wageendperiod) = date(vendperiod);


blockwage: begin
DECLARE done INT DEFAULT 0;
  DECLARE cur1 CURSOR FOR
    SELECT b.employeeid, a.wagetypeid, a.reason, a.amount, b.currencyid, d.joindate
    FROM employeebenefitdetail a
      inner join employeebenefit b on b.employeebenefitid = a.employeebenefitid
      inner join wagetype c on c.wagetypeid = a.wagetypeid
      inner join employee d on d.employeeid = b.employeeid
    where date(vendperiod) <= date(enddate)
          and isfinal = 1;
  DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;

  set vstartdate = vstartperiod;
  set venddate = vendperiod;

  select paramvalue
  into vidgapok
  from parameter
  where upper(paramname) = upper('wagegapok');

  select paramvalue
  into vidjabatan
  from parameter
  where upper(paramname) = upper('wagejabatan');

  select paramvalue
  into vidkhusus
  from parameter
  where upper(paramname) = upper('wagekhusus');

	if checkaccperiod(vstartperiod) > 0 then

    OPEN cur1;
    read_loop: LOOP
      FETCH cur1 INTO vid, vwagetypeid, vreason, vamount,vcurrencyid,vjoindate;
      IF done THEN
        LEAVE read_loop;
      END IF;

      
      select ifnull(count(1),0)
      into vcount
      from employeewage
        where date(wagestartperiod) = date(vstartperiod) and date(wageendperiod) = date(vendperiod)
        and employeeid=vid;

      if vcount = 0 then
        values (vid,vstartperiod,vendperiod,1);
	      set k=last_insert_id();
      else
          select employeewageid
          into k
          from employeewage
        where date(wagestartperiod) = date(vstartperiod) and date(wageendperiod) = date(vendperiod) and employeeid=vid;

      end if;

      if ((vjoindate >= vstartperiod) and (vjoindate <= vendperiod)) then
        if ((vwagetypeid = vidgapok) or (vwagetypeid = vidjabatan) or (vwagetypeid = vidkhusus)) then
          select getfulldaywork(vid,vstartperiod,vendperiod)
          into vfulldaywork;
          select getdaywork(vid,vjoindate,vendperiod)
          into vdaywork;
          set vtotal = (vdaywork / vfulldaywork) * vamount;

          values (k, vwagetypeid, vstartdate,venddate, vtotal,vcurrencyid,vreason);
        else
          values (k, vwagetypeid, vstartdate,venddate, vamount,vcurrencyid,vreason);
        end if;
      else
        values (k, vwagetypeid, vstartdate,venddate, vamount,vcurrencyid,vreason);
      end if;

      
      select ifnull(count(1),0)
      into vcount
      from employeetax
        where date(taxstartperiod) = date(vstartperiod) and date(taxendperiod) = date(vendperiod)
        and employeeid=vid;

      if vcount = 0 then
        values (vid,vstartperiod,vendperiod,1);
	      set k=last_insert_id();
      else
          select employeetaxid
          into k
          from employeetax
        where date(taxstartperiod) = date(vstartperiod) and date(taxendperiod) = date(vendperiod) and employeeid=vid;

      end if;

      if ((vjoindate >= vstartperiod) and (vjoindate <= vendperiod)) then
        if ((vwagetypeid = vidgapok) or (vwagetypeid = vidjabatan) or (vwagetypeid = vidkhusus)) then
          select getfulldaywork(vid,vstartperiod,vendperiod)
          into vfulldaywork;
          select getdaywork(vid,vjoindate,vendperiod)
          into vdaywork;
          set vtotal = (vdaywork / vfulldaywork) * vamount;

          values (k, vwagetypeid, vstartdate,venddate, vtotal,vcurrencyid,vreason);
        else
          values (k, vwagetypeid, vstartdate,venddate, vamount,vcurrencyid,vreason);
        end if;
      else
        values (k, vwagetypeid, vstartdate,venddate, vamount,vcurrencyid,vreason);
      end if;

    END LOOP;
    CLOSE cur1;

  else
    CALL pRaiseError('<igrover>');
  end if;
end blockwage;



blocktax: begin
  DECLARE done INT DEFAULT 0;
  declare vtotalbebanpajakrutinperusahaan,vtotalbebanpajaknonrutinperusahaan,vtotalbebanpajakrutinpekerja,
    vptkp,vtunjanganpajak,vpotonganpajak,vpenalty,vdihitung,
    vtotalbebanpajaknonrutinpekerja decimal(30,4);
  DECLARE cur1 CURSOR FOR
    SELECT a.employeeid,a.employeewageid
    FROM employeewage a
    where date(vendperiod) = date(wageendperiod)
          and date(vstartperiod) = date(wagestartperiod);
  DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;

    OPEN cur1;
    read_loop: LOOP
      FETCH cur1 INTO vid, vempwageid;
      IF done THEN
        LEAVE read_loop;
      END IF;

      select ifnull(sum(amount),0)
      into vtotalbebanpajakrutinperusahaan
      from employeewagedetail a
      inner join wagetype b on b.wagetypeid = a.wagetypeid
      where a.employeewageid = vempwageid and b.ispph = 1 and b.isrutin=1 and paidbycompany=1;

      select ifnull(sum(amount),0)
      into vtotalbebanpajaknonrutinperusahaan
      from employeewagedetail a
      inner join wagetype b on b.wagetypeid = a.wagetypeid
      where a.employeewageid = vempwageid and b.ispph = 1 and b.isrutin=0 and paidbycompany=1;

      select ifnull(sum(amount),0)*-1
      into vtotalbebanpajakrutinpekerja
      from employeewagedetail a
      inner join wagetype b on b.wagetypeid = a.wagetypeid
      where a.employeewageid = vempwageid and b.ispph = 1 and b.isrutin=1 and paidbycompany=0;

      select ifnull(a.taxvalue,0) * 12
      into vptkp
      from employeestatus a
      inner join employee b on b.employeestatusid = a.employeestatusid
      where b.employeeid = vid;

      set @vtunjanganpajak = 0;
      set @vbrutosetahun = 0;
      set @vbiayajabatansetahun = 0;
      set @vnettosetahun = 0;
      set @vpkp = 0;

      call grossup(@vtunjanganpajak,
        vtotalbebanpajakrutinperusahaan,
        abs(vtotalbebanpajakrutinpekerja),
        vptkp,
  @vbrutosetahun,
@vbiayajabatansetahun,
@vnettosetahun,
@vpkp );

set vpphsetahunrutin = @vtunjanganpajak*12;


      update employeewagedetail
      set amount = @vtunjanganpajak
      where wagetypeid = getparamvalue('tunjanganpajakrutinpp') and employeewageid = vempwageid;

      update employeetaxdetail
      set amount = @vtunjanganpajak
      where wagetypeid = getparamvalue('tunjanganpajakrutinpp') and employeetaxid = vempwageid;


select ifnull(sum(amount),0)
      into vtotalbebanpajaknonrutinperusahaan
      from employeewagedetail a
      inner join wagetype b on b.wagetypeid = a.wagetypeid
      where a.employeewageid = vempwageid and b.ispph = 1 and b.isrutin=0 and paidbycompany=1 and pphbycompany=1;


      update employeewagedetail
      set amount = @vtunjanganpajak*-1
      where wagetypeid = getparamvalue('potonganpajakrutinpp')  and employeewageid = vempwageid;

      update employeetaxdetail
      set amount = @vtunjanganpajak*-1
      where wagetypeid = getparamvalue('potonganpajakrutinpp') and employeetaxid = vempwageid;

      set @vtunjanganpajak = 0;
      set @vpotonganpajak = 0;
      set @vbrutosetahun = 0;
      set @vbiayajabatansetahun = 0;
      set @vnettosetahun = 0;
      set @vpkp = 0;

      call grossupnonrutin(@vtunjanganpajak,
        vtotalbebanpajakrutinperusahaan,
vtotalbebanpajaknonrutinperusahaan,
        abs(vtotalbebanpajakrutinpekerja),
        vptkp,
  @vbrutosetahun,
@vbiayajabatansetahun,
@vnettosetahun,
@vpkp );

set vpphsetahunnonrutin = abs(vpphsetahunrutin- (@vtunjanganpajak*12));

      update employeewagedetail
      set amount = vpphsetahunnonrutin
      where wagetypeid = getparamvalue('tunjanganpajaknonrutinpp') and employeewageid = vempwageid;

      update employeetaxdetail
      set amount = vpphsetahunnonrutin
      where wagetypeid = getparamvalue('tunjanganpajaknonrutinpp') and employeetaxid = vempwageid;

update employeewagedetail
      set amount = vpphsetahunnonrutin*-1
      where wagetypeid = getparamvalue('potonganpajaknonrutinpp')  and employeewageid = vempwageid;

      update employeetaxdetail
      set amount = vpphsetahunnonrutin*-1
      where wagetypeid = getparamvalue('potonganpajaknonrutinpp') and employeetaxid = vempwageid;


select ifnull(sum(amount),0)
      into vtotalbebanpajaknonrutinpekerja
      from employeewagedetail a
      inner join wagetype b on b.wagetypeid = a.wagetypeid
      where a.employeewageid = vempwageid and b.ispph = 1 and b.isrutin=0 and paidbycompany=0 and pphbycompany=0;


set @vtunjanganpajak = 0;
      set @vpotonganpajak = 0;
      set @vbrutosetahun = 0;
      set @vbiayajabatansetahun = 0;
      set @vnettosetahun = 0;
      set @vpkp = 0;

      call grossupnonrutin(@vtunjanganpajak,
        vtotalbebanpajakrutinperusahaan,
vtotalbebanpajaknonrutinpekerja,
        abs(vtotalbebanpajakrutinpekerja),
        vptkp,
  @vbrutosetahun,
@vbiayajabatansetahun,
@vnettosetahun,
@vpkp );

set vpphsetahunnonrutin = abs((@vtunjanganpajak*12) - vpphsetahunrutin);

      update employeewagedetail
      set amount = vpphsetahunnonrutin
      where wagetypeid = getparamvalue('tunjangapajakrutinpekerja') and employeewageid = vempwageid;

      update employeetaxdetail
      set amount = vpphsetahunnonrutin
      where wagetypeid = getparamvalue('tunjangapajakrutinpekerja') and employeetaxid = vempwageid;

update employeewagedetail
      set amount = vpphsetahunnonrutin*-1
      where wagetypeid = getparamvalue('potonganpajakrutinpekerja')  and employeewageid = vempwageid;

      update employeetaxdetail
      set amount = vpphsetahunnonrutin*-1
      where wagetypeid = getparamvalue('potonganpajakrutinpekerja') and employeetaxid = vempwageid;

    END LOOP;
    CLOSE cur1;
end blocktax;



END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

