--
-- Definition of procedure `smlive`.`RefundTrx`
--

DROP PROCEDURE IF EXISTS `smlive`.`RefundTrx`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`smlive`@`localhost` PROCEDURE  `smlive`.`RefundTrx`(vid int)
BEGIN
	declare db decimal;
	declare agentid int;
	declare dep decimal;
	declare vch text;
	declare hpd text;
	declare idy text;
	declare hps text;
	declare msg text;

	select debet,voucheragentid,vouchername,hpdest,hpsender,idym
	into db,agentid,vch,hpd,hps,idy
	from vouchertrx
	where vouchertrxid = vid;
	
	update voucheragent
	set deposit = ifnull(deposit,0) + ifnull(db,0)
	where voucheragentid = agentid;

	select deposit
	into dep
	from voucheragent
	where voucheragentid = agentid;

	set msg = concat('REFUND ',replace(hpd,'+62','0'),' ',db,' Saldo ',dep, ' ', getparamvalue('CURRENTINFO'));

	
	values (sysdate(), getparamvalue('stockymnoti0'), concat('REFUND ',replace(hpd,'+62','0'), ' kode ',vch,' agentid ',agentid,' hpsender ',replace(hps,'+62','0')), 
	getparamvalue('intymeng'), 1);

	if (hps <> '') then
    		values (msg, hps, getphonesid(hps));
	else
		if (idy <> '') then
    			values (msg, idy, getparamvalue('intymeng'),1);
		end if;
	end if; 

	update vouchertrx
	set recordstatus = 0, trxend = sysdate()
	where vouchertrxid = vid;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

--
-- Definition of procedure `smlive`.`SMSProcess`
--

DROP PROCEDURE IF EXISTS `smlive`.`SMSProcess`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`smlive`@`localhost` PROCEDURE  `smlive`.`SMSProcess`()
BEGIN
	declare done int default 0;
	declare textdec text;
	declare inid int;
	declare hpsender varchar(50);
	declare sformatin text;
	declare sformatout text;
	declare sformaterror text;
	declare sdeferror text;
	declare stopup text;
	declare sexecproc text;
	declare tsms text;
	declare i int;
	declare j int;
	declare sqlst text;
	declare msg text;
	declare cur1 cursor for
		select id,textdecoded,sendernumber 
		from inbox 
		where processed = 'false' and
		textdecoded <> '' order by id asc;
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;

	open cur1;
	repeat
		fetch cur1 into inid, textdec, hpsender;
		if not done then
			values (sysdate(),hpsender,textdec);
			delete from inbox 
			where id = inid; 
			set tsms = split_str(textdec,'.',1);
			select formaterror
			into sdeferror
			from smsformat
			where lower(smsname) = 'defaulterror' limit 1;
			set sqlst = '';
			set msg = '';
			if (countsplitstr(textdec, '.') > 0) then
				select ifnull(count(1),0)
				into i  
				from smsformat 
				where upper(smsname) = upper(tsms) limit 1;
				if (i > 0) then
					select ifnull(formatin,'error'), ifnull(formaterror,'error'), ifnull(formatout,'error'), ifnull(execproc, 'error'), ifnull(istopup, 0)
					into sformatin, sformaterror, sformatout, sexecproc, stopup  
					from smsformat 
					where upper(smsname) = upper(tsms) limit 1;
					if (countsplitstr(sformatin,'.') >= countsplitstr(textdec, '.') + 1) then
						set sqlst = quote(replace(hpsender, '+62', '0'));
						set i = 2;
						if (stopup = 0) then
							repeat
								set sqlst = concat(sqlst,',',quote(split_str(textdec,'.',i)));
								set i = i + 1;
							until i > countsplitstr(sformatin, '.') end repeat;
						else
							set sqlst = concat(sqlst,',',quote(split_str(textdec,'.',1)));		
							repeat
								set sqlst = concat(sqlst,',',quote(split_str(textdec,'.',i)));
								set i = i + 1;
							until i > countsplitstr(sformatin, '.')-1 end repeat;
						end if;
						set @strSQL = concat (_utf8 'select ',sexecproc, ' (', sqlst, ')');
						prepare stmt_name from @strSQL;
						execute stmt_name;
						deallocate prepare stmt_name;
					else
						set msg = sformaterror;
					end if;
				else
					set msg = sdeferror;
				end if;
			else
				set msg = sdeferror;			
			end if;		
			if (msg <> '') then
				values (msg, hpsender, getphonesid(hpsender));
			end if;
		end if;
	until done end repeat;
	close cur1;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

