--
-- Definition of procedure `smlive`.`UpdateAbsTrans`
--

DROP PROCEDURE IF EXISTS `smlive`.`UpdateAbsTrans`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`smlive`@`localhost` PROCEDURE  `smlive`.`UpdateAbsTrans`(vabstransid integer, vemployeeid integer, vdate datetime,
vmachineid integer, vmessages varchar(50))
BEGIN
	declare vstatus,vstatin,vstatout varchar(50);
	declare vid,vschedid,vabsstat,vitimein,vitimeout int;
	declare vsdate,vsdate1 datetime;

	set vsdate = vdate;
	set vschedid = getempschedbyempdate(vemployeeid,vsdate);
	set vstatus = getabsrulestatusbyschedid(vschedid,vsdate);
	if (vstatus is null) then
		set vsdate=date_sub(vdate,interval 1 day);
		set vschedid=getempschedbyempdate(vemployeeid,vsdate);
		set vstatus=getabsrulestatusbyschedid(vschedid,vsdate);
		call updatereportoutbyempdate(vemployeeid,vsdate,vstatus);		
	else
		
		select isin
		into vid
		from absstatus
		where upper(shortstat) = upper(vstatus);

		if vid = 0 then
			select count(1) 
			into vid
			from reportperday
			where day(absdate)=day(vsdate) and month(absdate)=month(vsdate) and
				year(absdate)=year(vsdate) and employeeid=vemployeeid;

			if (vid=0) then			
				set vsdate=date_sub(vdate,interval 1 day);
				set vschedid=getempschedbyempdate(vemployeeid,vsdate);
				set vstatus=getabsrulestatusbyschedid(vschedid,vsdate);
			else
				select absdate
				into vsdate1
				from reportperday
				where day(absdate)=day(vsdate) and month(absdate)=month(absdate) and
				year(absdate)=year(absdate) and employeeid=vemployeeid;

				if (vsdate < vsdate1) then
					set vsdate=date_sub(vdate,interval 1 day);
					set vschedid=getempschedbyempdate(vemployeeid,vsdate);
					set vstatus=getabsrulestatusbyschedid(vschedid,vsdate);
				end if;
			end if;
			call updatereportoutbyempdate(vemployeeid,vsdate,vstatus);
		else
			call updatereportinbyempdate(vemployeeid,vsdate,vstatus,vschedid);
			call updatereportjamsostekbyempdate(vemployeeid,vsdate,vstatus);
		end if;	
	end if;

	select longstat
	into vstatus
	from absstatus
	where upper(shortstat) = upper(vstatus);

	update abstrans 
	set status=vstatus, messages=vmessages, machineid = vmachineid
	where abstransid = vabstransid; 
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

