BEGIN
	
	declare oabid, oemployeename,ooldnik,oorgstructureid,opositionid,oemployeetypeid,
	 osexid, obloodtypeid, obirthcityid, obirthdate, oreligionid, 
	 omaritalstatusid, otribeid, oreferenceby, ojoindate, 
	 oemployeestatusid, oistrial, obodyheight, obodyweight, odresssize,
	 oshoesize text;
	select b.addressbookid, b.fullname,oldnik,orgstructureid,positionid,employeetypeid,
	 sexid, bloodtypeid, birthcityid, birthdate, religionid, 
	 maritalstatusid, tribeid, referenceby, joindate, 
	 employeestatusid, istrial, bodyheight, bodyweight, dresssize,
	 shoesize
	into oabid, oemployeename,ooldnik,oorgstructureid,opositionid,oemployeetypeid,
	 osexid, obloodtypeid, obirthcityid, obirthdate, oreligionid, 
	 omaritalstatusid, otribeid, oreferenceby, ojoindate, 
	 oemployeestatusid, oistrial, obodyheight, obodyweight, odresssize,
	 oshoesize
	from employee a 
	inner join addressbook b on b.addressbookid = a.addressbookid
	where employeeid = vemployeeid;

	update employee
	set fullname=vemployeename, oldnik = voldnik,orgstructureid=vorgstructureid,positionid=vpositionid,
		employeetypeid=vemployeetypeid,sexid=vsexid,bloodtypeid=vbloodtypeid,
