		maritalstatusid=vmaritalstatusid,tribeid=vtribeid,referenceby=vreferenceby,
		joindate=vjoindate,employeestatusid=vemployeestatusid,
		istrial=vistrial,bodyheight=vbodyheight,bodyweight=vbodyweight,
		dresssize=vdresssize,shoesize=vshoesize
	where employeeid = vemployeeid;

	update addressbook
	set fullname = vemployeename
	where addressbookid = oabid;
END $$
