--
-- Definition of procedure `smlive`.`UpdateEmployee`
--

DROP PROCEDURE IF EXISTS `smlive`.`UpdateEmployee`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`smlive`@`localhost` PROCEDURE  `smlive`.`UpdateEmployee`(vemployeeid integer,
vemployeename varchar(50),
vorgstructureid integer, vpositionid integer,vemployeetypeid integer,
vsexid integer, vbirthcityid integer, vbirthdate date,
vreligionid integer, vmaritalstatusid integer, vreferenceby varchar(50),
vjoindate date, vemployeestatusid integer, vistrial integer, vdplkno varchar(20), vlastupdateby integer,vlevelorg integer,
vemail varchar(50),vphoneno varchar(50),valternateemail varchar(50),vhpno varchar(50),
vtaxno varchar(50),vhpno2 varchar(20),vmedical text,vaccountno varchar(50),
vresigndate date)
BEGIN

	declare oabid,ogol,ocompany,oposition,olevel text;
	select b.addressbookid, a.levelorgid, c.positionname,d.levelorgname
	into oabid, ogol,oposition,olevel
	from employee a
	inner join addressbook b on b.addressbookid = a.addressbookid
  left join position c on c.positionid = a.positionid
  left join levelorg d on d.levelorgid = a.levelorgid
	where employeeid = vemployeeid;

  select companyname
  into ocompany
  from company
  limit 1;


  if ogol <> vlevelorg then
    values (vemployeeid,ocompany,oposition,olevel,concat(date_format(now(),'%d-%M-%Y'),' s/d sekarang'),1,1);
  end if;


	update employee
	set fullname=vemployeename, orgstructureid=vorgstructureid,positionid=vpositionid,
		employeetypeid=vemployeetypeid,sexid=vsexid,
		birthcityid=vbirthcityid,birthdate=vbirthdate,religionid=vreligionid,
		maritalstatusid=vmaritalstatusid,referenceby=vreferenceby,
		joindate=vjoindate,employeestatusid=vemployeestatusid,
		istrial=vistrial,dplkno=vdplkno,levelorgid=vlevelorg,
		email=vemail,phoneno=vphoneno,alternateemail=valternateemail,hpno=vhpno,taxno=vtaxno,
    hpno2=vhpno2,medical=vmedical,accountno=vaccountno,resigndate=vresigndate
	where employeeid = vemployeeid;

	update addressbook
	set fullname = vemployeename
	where addressbookid = oabid;

  
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

