--

DROP PROCEDURE IF EXISTS `smlive`.`UpdateProductLot`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`smlive`@`localhost` PROCEDURE  `smlive`.`UpdateProductLot`(vproductlotid integer,vproductid integer,
vlotno varchar(50), vstartdate date, vdsled date, vcreatedby varchar(50))
BEGIN
	declare visautolot, vsled, vsnroid integer;

	select isautolot, sled, snroid
	into visautolot, vsled, vsnroid
	from productplant
	where productid = vproductid;

	if (visautolot = 1) then
		select getrunno(vsnroid,vstartdate)
		into vlotno;
	end if;

	select adddate(vstartdate, INTERVAL vsled day) into vdsled;

	update productlot 
	set productid = vproductid, lotno = vlotno, startdate = vstartdate, sled = vdsled
	where productlotid = vproductlotid;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

