vstatus varchar(3))
BEGIN
	declare ijam,imenit,tgl,bulan,tahun,vid,vreturn int;
	declare jam,menit varchar(2);
	declare volds varchar(5);

  	select day(vDate) into tgl;
  	select month(vDate) into bulan;
