--
-- Definition of procedure `smlive`.`UpdateTrxFromYM`
--

DROP PROCEDURE IF EXISTS `smlive`.`UpdateTrxFromYM`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`smlive`@`localhost` PROCEDURE  `smlive`.`UpdateTrxFromYM`()
BEGIN
	declare done int default 0;
	declare yid int;
	declare textdec text;
	declare strx varchar(50);
	declare snu varchar(50);
	declare hps varchar(50);
	declare vou varchar(50);
	declare yms varchar(50);
	declare hpsndr varchar(50);
	declare ymd varchar(50);
	declare pid varchar(50);
	declare chps varchar(50);
	declare hrg decimal;
	declare saldo decimal;
	declare agentid int;
	declare voun varchar(50);
	declare imi varchar(50);
	declare cur1 cursor for 
		select a.yminboxid,a.textdecoded, a.ymsender 
		from yminbox a inner join vouchersource b on lower(b.idymsource) = lower(a.ymsender)
		where lower(a.textdecoded) like concat('%',lower(b.successword),'%') and a.recordstatus = 1;
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;

	open cur1;
	repeat
		fetch cur1 into yid, textdec, yms;
		if not done then
			select split_str(substr(textdec, 
				position(lower(b.hpword) in lower(textdec)) + length(b.hpword) + length(b.valuesep)), 
				' ', 1),
				split_str(substr(lower(textdec), position(lower(b.sn) in lower(lower(textdec))) + length(b.sn) + length(b.valuesep)), ' ', 1),
				split_str(substr(textdec, position(lower(b.trxword) in lower(textdec)) + length(b.trxword) + length(b.valuesep)), ' ', 1),
				replace(replace(split_str(substr(lower(textdec), position(lower(b.sourcecode) in lower(textdec)) + length(b.sourcecode) + length(b.valuesep)), ' ', 1),'/',''), replace(replace(b.junkwords,'[',''),']',''),'')
			into hps,snu,strx,vou 
			from vouchersource b where lower(idymsource) = lower(yms);

			select b.vouchername
			into voun
			from voucherformap a inner join voucherprice b on b.voucherpriceid = a.voucherpriceid
			where lower(vouchercode) = lower(vou); 
	
			select a.hpsender,a.idym,a.debet,a.voucheragentid
			into hpsndr,ymd,hrg,agentid
			from vouchertrx a
			where lower(hpdest) = lower(hps) and lower(vouchername) = lower(voun) and recordstatus =1;

			update vouchertrx a 
			set sn = snu, sourcetrx = strx, recordstatus = 2
			where lower(hpdest) = lower(hps) and lower(vouchername) = lower(voun) and recordstatus =1;

			select ifnull(deposit,0)
			into saldo
			from voucheragent
			where voucheragentid = agentid;

			if hpsndr <> '' then
				if left(hpsndr,1) = '+' then
					set chps = left(hpsndr,6);					
				else
					set chps = left(hpsndr,1);
				end if;

				select phonesid
				into imi
				from phonecenterlist
				where prefixnumber = chps;

				select `id`
				into pid
				from phones
				where imei = imi;

				select pid;
				select hps;

				values (pid,concat('Berhasil ',hps,' ',voun,' ',hrg,' ',saldo),hpsndr);
			else
			if ymd <> '' then
				select ymd;
				
				values (ymd,concat('Berhasil ',hps,' ',voun,' ',hrg,' ',saldo),'');
			end if;	
			end if;
			update yminbox
			set recordstatus = 0
			where yminboxid = yid;

		end if;
	until done end repeat;
	close cur1;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

