--
-- Definition of procedure `smlive`.`UpdateWarnetPackage`
--

DROP PROCEDURE IF EXISTS `smlive`.`UpdateWarnetPackage`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`smlive`@`localhost` PROCEDURE  `smlive`.`UpdateWarnetPackage`(vwarnetpackageid integer, 
vpackagename varchar(50),vismember integer,vminused integer, vfromhour varchar(5), vtohour varchar(5), 
vdiscount integer, visusingprice integer, vvalcount integer, vvaluom integer, vpricepercount integer,
vlastupdateby integer)
BEGIN
	declare opackagename,oismember,ominused,ofromhour,otohour,odiscount,oisusingprice,
		ovalcount,ovaluom,opricepercount text;
	select packagename,ismember,minused,fromhour,tohour,discount,isusingprice,
		valcount,valuom,pricepercount
	into opackagename,oismember,ominused,ofromhour,otohour,odiscount,oisusingprice,
		ovalcount,ovaluom,opricepercount
	from warnetpackage
	where warnetpackageid = vwarnetpackageid;
	values (concat('update warnetpackage warnetpackageid=',vwarnetpackageid,
		' packagename=',opackagename,'>',vpackagename,
		' ismember=',oismember,'>',vismember,
		' minused=',ominused,
		' fromhour=',ofromhour,
		' tohour=',otohour,
		' discount=',odiscount,
		' isusingprice=',oisusingprice,
		' valcount=',ovalcount,
		' valuom=',ovaluom,
		' pricepercount=',opricepercount,
		' by=',vlastupdateby,' date=',sysdate()));

	update warnetpackage 
	set packagename=vpackagename, ismember=vismember, minused=vminused,
		fromhour=vfromhour,tohour=vtohour,discount=vdiscount,isusingprice=visusingprice,
		valcount=vvalcount,valuom=vvaluom,pricepercount=vpricepercount
	where warnetpackageid=vwarnetpackageid;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

