DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`smlive`@`localhost` PROCEDURE  `smlive`.`UploadWarnetMember`(vwarnetmemberid integer,
vmembername varchar(50), vpassword varchar(50), vmemberstatusid integer, vcreatedby integer)
BEGIN
	declare i integer;
	declare j integer;
	values (vmembername, 1, 0, 0, 0, 1);
	set j = last_insert_id();

	select ifnull(max(nik),0)+1
	into i
	from warnetmember;

	values (j,i,vpassword,vmemberstatusid);	

	values (concat('upload addressbook fullname=',vmembername,' iscustomer=1 by=',vcreatedby,' date=',sysdate()));

	values (concat('upload warnetmember addressbookid=',j,' password=',vpassword,' date=',sysdate()));
END $$
