--
-- Definition of procedure `smlive`.`YmIProcess`
--

DROP PROCEDURE IF EXISTS `smlive`.`YmIProcess`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`smlive`@`localhost` PROCEDURE  `smlive`.`YmIProcess`()
BEGIN
	declare done int default 0;
	declare textdec text;
	declare inid int;
	declare idy varchar(50);
	declare phonesid varchar(50);
	declare sformatin text;
	declare sformatout text;
	declare sformaterror text;
	declare sdeferror text;
	declare stopup text;
	declare sexecproc text;
	declare tsms text;
	declare i int;
	declare j int;
	declare sqlst text;
	declare msg text;
	declare cur1 cursor for
		select yminboxid,textdecoded,ymsender 
		from yminbox a inner join 
		memberym b on lower(b.idym) = lower(a.ymsender)
		where a.recordstatus = 1 and
		a.textdecoded <> '' order by yminboxid asc;
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;

	open cur1;
	repeat
		fetch cur1 into inid, textdec, idy;
		if not done then
			values (sysdate(),idy,textdec);
			delete from yminbox 
			where yminboxid = inid;
			set tsms = split_str(textdec,'.',1);
			select formaterror
			into sdeferror
			from ymformat
			where lower(ymname) = 'defaulterror' limit 1;
			set sqlst = '';
			set msg = '';
			if (countsplitstr(textdec, '.') > 0) then
				select ifnull(count(1),0)
				into i  
				from ymformat 
				where upper(ymname) = upper(tsms) limit 1;
				if (i > 0) then
					select formatin, formaterror, formatout, execproc, istopup
					into sformatin, sformaterror, sformatout, sexecproc, stopup  
					from ymformat 
					where upper(ymname) = upper(tsms) limit 1;
					if (countsplitstr(sformatin,'.') >= countsplitstr(textdec, '.') + 1) then
						set sqlst = quote(idy);
						set i = 2;
						if (stopup = 0) then
							repeat
								set sqlst = concat(sqlst,',',quote(split_str(textdec,'.',i)));
								set i = i + 1;
							until i > countsplitstr(sformatin, '.') end repeat;
						else
							set sqlst = concat(sqlst,',',quote(split_str(textdec,'.',1)));		
							repeat
								set sqlst = concat(sqlst,',',quote(split_str(textdec,'.',i)));
								set i = i + 1;
							until i > countsplitstr(sformatin, '.')-1 end repeat;
						end if;
						set @strSQL = concat (_utf8 'select ',sexecproc, ' (', sqlst, ')');
						prepare stmt_name from @strSQL;
						execute stmt_name;
						deallocate prepare stmt_name;
					else
						set msg = sformaterror;
					end if; 
				else
					set msg = sdeferror;
				end if;	
			else
				set msg = sformaterror;				
			end if;
			if (msg <> '') then
				values (idy, msg, getparamvalue('intymeng'), 1);
			end if;
		end if;
	until done end repeat;
	close cur1;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

--
-- Definition of procedure `smlive`.`ymoutbox`
--

DROP PROCEDURE IF EXISTS `smlive`.`ymoutbox`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`smlive`@`localhost` PROCEDURE  `smlive`.`ymoutbox`()
BEGIN
        declare done int default 0;
        declare yinid int;
	declare textdec text;
	declare hpw text;
	declare vsep text;
	declare sc text;
	declare i int;
	declare sw text;
	declare fw text;
	declare rw text;
	declare dw text;
	declare snw text;
	declare hps text;
	declare idy text;
	declare msg text;
	declare hpd text;
	declare deb decimal;
	declare sld decimal;
	declare agentid int;
	declare hpv text;
	declare scv text;
        declare cur1 cursor for
                select a.yminboxid, a.textdecoded, b.hpword, b.valuesep,
		b.sourcecode, b.successword, b.failedword, b.refundword,
		b.doubleword,b.sn
		from yminbox a inner join 
		vouchersource b on lower(b.idymsource) = lower(a.ymsender)
		where (lower(a.textdecoded) like concat('%',lower(b.successword), '%') or
		lower(a.textdecoded) like concat('%',lower(b.failedword), '%') or
		lower(a.textdecoded) like concat('%',lower(b.refundword), '%')
		) and
		a.recordstatus = 1;
        DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;

        open cur1;
        repeat
                fetch cur1 into yinid,textdec,hpw,vsep,sc,sw,fw,rw,dw,snw;
                if not done then
			
			set hpv = gethpvalue(textdec,vsep,hpw);
			set scv = getscvalue(textdec,vsep,sc);
			select ifnull(count(1),0)
			into i
			from vouchertrx
			where hpdest = hpv  and
			lower(sourcetrx) like concat('%',lower(scv),'%')  and
 			(recordstatus = 1 or recordstatus=2);
			if (i > 0) then
				select vouchertrxid, hpdest,hpsender,idym,debet,saldo,voucheragentid
				into i,hpd,hps,idy,deb,sld,agentid
				from vouchertrx
				where hpdest = hpv and
				lower(sourcetrx) like concat('%',lower(scv),'%')  and
 				(recordstatus = 1 or recordstatus=2) limit 1;
				
				if ((position(lower(sw) in lower(textdec)) > 0) and (position(lower(dw) in lower(textdec)) = 0)) then
					update vouchertrx
					set sn = getsnvalue(textdec,vsep,snw), trxend = sysdate(), recordstatus = 3
					where vouchertrxid = i;
					set msg = concat('Berhasil ',hpd,' ',deb,' Saldo ',sld,'.',getinfo());
				else
					if ((position(lower(sw) in lower(textdec)) > 0) and (position(lower(dw) in lower(textdec)) > 0)) then
						update vouchertrx
						set sn = getsnvalue(textdec,vsep,snw), trxend = sysdate(), 
						reason = textdec, recordstatus = 4
						where vouchertrxid = i;
						call refundtrx(i);
						set msg = concat('Refund ',hpd,' ',deb,' Saldo ',getdeposit(agentid),'.',getinfo());
					else
						update vouchertrx
						set trxend = sysdate(), reason = textdec, recordstatus = 0
						where vouchertrxid = i;
						call refundtrx(i);
						set msg = concat('Gagal ',hpd,' ',deb,' Saldo ',getdeposit(agentid),'.',getinfo());
					end if;
				end if;
			end if;
			if (msg <> '') then
				if (hps <> '') then
    					values (msg, hps, getphonesid(hps),1);
				else
					if (idy <> '') then
    						values (msg, idy, getparamvalue('intymeng'),1);
					end if;
				end if;
			end if;
                end if;
        until done end repeat;
        close cur1;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

--
-- Definition of procedure `smlive`.`YMProcess`
--

DROP PROCEDURE IF EXISTS `smlive`.`YMProcess`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */ $$
CREATE DEFINER=`smlive`@`localhost` PROCEDURE  `smlive`.`YMProcess`()
BEGIN
	declare done int default 0;
	declare yinid int;
	declare textdec text;
	declare hpw text;
	declare vsep text;
	declare sc text;
	declare i int;
	declare cur1 cursor for
		select a.yminboxid, a.textdecoded, b.hpword, b.valuesep,b.sourcecode
		from yminbox a inner join 
		vouchersource b on lower(b.idymsource) = lower(a.ymsender)
		where lower(a.textdecoded) like concat('%',lower(b.waitword), '%') and
		a.recordstatus = 1;
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;

	open cur1;
	repeat
		fetch cur1 into yinid,textdec,hpw,vsep,sc;
		if not done then
			update vouchertrx
			set recordstatus = 2, trxend = sysdate()
			where hpdest = gethpvalue(textdec,vsep,hpw) and
			sourcetrx = replace(getscvalue(textdec,vsep,sc),'/nasional','') and
 			recordstatus = 1;
			delete from yminbox
			where yminboxid = yinid; 	
		end if;
	until done end repeat;
	close cur1;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;



